INSERT INTO `ad_nghebai` (`id_nghe`, `nghe_content`, `nghe_dapan`, `nghe_music`, `id_bai`, `congkhai`, `xoa`) VALUES
(9, 'He goes to class. There is an empty seat in front. He sits in the seat. He looks around. There are different people. He says \"hi\" to the girl next to him. She smiles. The teacher comes in. She closes the door. Everyone is silent. The first day of school begins.', 'to,empty,sits,looks,different,says,girl,closes,silent,school', 'https://cuoituan.vn/media/hocvui/amthanh_600767277.mp3', 2, 1, 1),
(10, 'She is thirsty. She gets a glass of water. She begins to walk. She drops the glass. There is water on the floor. The puddle is big. She gets a mop. She wipes the water off. The floor is clean. She gets another glass of water. She drinks it. She is happy.', 'thirsty,glass,walk,drops,floor,puddle,mop,wipes,clean,drink', 'https://cuoituan.vn/media/hocvui/amthanh_1062669295.mp3', 20, 1, 0),
(11, 'Casey wants a new car. She needs money. She decides to babysit. She takes care of the child. She feeds him lunch. She reads him a story. The story is funny. The child laughs. Casey likes him. The child\'s mom comes home. The child kisses Casey. Casey leaves. She will babysit him again.', 'wants,needs,to,takes,of,feeds,story,likes,kisses,will', 'https://cuoituan.vn/media/hocvui/amthanh_1926893435.mp3', 2, 1, 0),
(12, 'Jill and Jodi are twins. They look the same. But they act differently. Jill likes sports. She is good at basketball and golf. She is also loud. She talks all day. Jodi likes reading. She can read 300 pages a day. She is also quiet. She does not like to talk. Jill and Jodi still love each other.', 'are,the,act,likes,basketball,golf,talks,pages,not,each', 'https://cuoituan.vn/media/hocvui/amthanh_2056587719.mp3', 22, 1, 0),
(13, 'Sam is a doctor. He takes care of people. He smiles at them. He gives them medicine. He gives stickers to the younger patients. The younger patients like him. They see him when they are sick. He makes them feel better. This makes him happy. He loves his job. He goes home proud.', 'doctor,care,smiles,medicine,stickers,patients,sick,feel,happy,proud', 'https://cuoituan.vn/media/hocvui/amthanh_1668765783.mp3', 21, 1, 0),
(16, 'The book is in the library. Jodi goes to the library. She wants to borrow it. She uses her card to check it out. She takes the book back home. She sits on the couch. She reads the first page. It is good. She reads twenty more pages. It is not that good anymore. Jodi returns the book.', 'the,goes,borrow,check,takes,back,sits,first,twenty,returns', 'https://cuoituan.vn/media/hocvui/amthanh_359531459.mp3', 26, 1, 0),
(17, 'Mary goes to the store. The store is very big. The store sells bakery goods. Mary sees a carrot cake. She does not like carrots. She sees a banana nut muffin. It looks good. It costs two dollars. She buys it. She takes the wrapper off. She takes a big bite. It is crunchy on the outside. It is soft on the inside.', 'store,bakery,goods,carrot,cake,banana,muffin,dollars,wrapper,bite', 'https://cuoituan.vn/media/hocvui/amthanh_1876573239.mp3', 27, 1, 0),
(18, 'He woke up. He got out of bed. He went to the restroom and took a shower. The water was cold at first. He made it warm. He took ten minutes to shower. He stepped out of the shower. The floor became wet. He grabbed a towel. He wrapped it all around him. He went to his bathroom mirror. He saw his reflection. He looked handsome. He had grown facial hair. It was time for him to shave it. He grabbed the shaving cream and poured some in his hand. He spread the shaving cream around his face. He grabbed the razor and started shaving. He cut himself by accident. It started bleeding. He was not hurt. He washed his face and applied aftershave. He put a band-aid on his cut. The cut stung him a little. He dried himself, and started getting ready for work.', 'woke,shower,wet,grabbed,wrapped,shaving,razor,accident,stung,dried', 'https://cuoituan.vn/media/hocvui/amthanh_1716724875.mp3', 38, 1, 0),
(19, 'It was night time. He went out to walk his dog. His dog was big. The dog\'s name was Max. \"Let\'s go, Max!\" he said to his dog. He walked past his neighbor\'s house. He saw there were no lights in the house. His neighbor was not home. He walked past the market. There were people shopping for groceries. He remembered he needed milk. He tied Max to a pole. \"Wait here, Max,\" he said. He walked inside the market. It took fifteen minutes to buy the milk. He untied Max and continued walking. He walked back to his house. He let Max inside the house. It was time to feed Max. He served Max a bowl of dog food. Max ate it quickly. It was late. He took Max to the backyard. Max slept in a dog house. He said good night to Max. Max barked.', 'walk,neighbor,market,milk,continued,served,bowl,ate,backyard,barked', 'https://cuoituan.vn/media/hocvui/amthanh_499721730.mp3', 39, 1, 0),
(20, 'It was a cold night. The moon was bright and round. The wind blew cold through the window. Jim got up from his couch and closed it. Jim was shivering because it was cold. He rubbed his hands together. Jim went to the kitchen. He wanted to make coffee. He opened his cabinet. He grabbed the can of coffee beans. He opened the lid. He held the can up to his nose. He took a deep breath. It smelled like fresh coffee beans. Jim loved the smell of coffee. He loved drinking coffee more. He poured the beans into the coffee maker. He grabbed a pitcher and put it in under the machine. He pressed a button and it started brewing. Jim started shivering again. He moved around to warm his body. The machine took fifteen minutes to finish. Jim poured the coffee into a mug. He drank it all. The coffee warmed his body. He stopped shivering.', 'blew,shivering,cabinet,lid,nose,button,brewing,mug,drank,stopped', 'https://cuoituan.vn/media/hocvui/amthanh_859951103.mp3', 43, 1, 0),
(21, 'Jim and his sister were walking home from school. \\\\\\\"How was school?\\\\\\\" Jim asked. \\\\\\\"It was nice,\\\\\\\" said Jim\\\\\\\'s sister. Her name was Nancy. Nancy was seven. She had black hair. Her hair was short and straight. She also had braces. Jim forgot to bring an umbrella for Nancy. Jim and Nancy huddled together under Jim\\\\\\\'s umbrella. The rain fell lightly. \\\\\\\"Let\\\\\\\'s hurry,\\\\\\\" Jim said. Jim and Nancy walked faster. Jim stepped on a puddle. The water splashed. Nancy\\\\\\\'s pants got wet. \\\\\\\"I\\\\\\\'m sorry,\\\\\\\" Jim said. \\\\\\\"It\\\\\\\'s okay,\\\\\\\" said Nancy. It started raining more. They soon arrived home. Lightning struck across the sky. It sounded loud. They were safe inside. Nancy\\\\\\\'s clothes were wet. She changed her clothes. Jim did the same. Nancy looked out the window. It was raining hard. She was glad to be inside. Jim felt the same.', 'straight,braces,umbrella,hurry,puddle,splashed,struck,sounded,glad,felt', 'https://cuoituan.vn/media/hocvui/amthanh_824955408.mp3', 46, 1, 0),
(22, 'She came back home from work. She looked at the clock and yawned. It was nine o\'clock. She went to her bedroom and put on her pajamas. She got her blanket. She lay down on her bed. The room was cold. She got up and went to her closet to get extra blankets. She lay down again and covered herself. She fell asleep. She woke up in the middle of the night to get a glass of water. She drank the glass of water. She walked back to her bedroom. She yawned and fell asleep. Two hours passed. She woke up and went to the restroom. She heard a noise outside her window. She looked out the window to see what it was. It was a black cat climbing a tree. She hushed the cat. The cat ran away. She went back to bed. She closed her eyes and fell asleep. She slept very little.', 'yawned,bedroom,pajamas,blanket,closet,glass,passed,noise,climbing,slept', 'https://cuoituan.vn/media/hocvui/amthanh_85637462.mp3', 47, 1, 0),
(23, 'It was a hot day. The sun was shining in the sky. The air was sticky. It was a Sunday afternoon. Jane was thirsty. She went to the kitchen to get a drink. She opened her refrigerator. There was nothing to drink inside. Jane grabbed some lemons and a big pitcher. She cut the lemons in two. She filled the large pitcher with water. She squeezed the lemons into the pitcher of water. She opened her cabinet to get the sugar. She poured some sugar into the pitcher of water and lemon juice. She had made lemonade. She took a sip of the lemonade. It needed more sugar. She grabbed the bag of sugar and poured a little more. She took another sip. The lemonade tasted sweet. All it needed now was ice. She opened the refrigerator to grab some ice. There was no ice.', 'shining,sticky,refrigerator,pitcher,squeezed,sugar,lemonade,sip,sweet,ice', 'https://cuoituan.vn/media/hocvui/amthanh_113453704.mp3', 50, 1, 0),
(24, 'It was a cloudy day. It looked like it was going to rain. Jim put on his raincoat and rain boots. He grabbed his umbrella and left his house. He had to walk to an elementary school to pick up his sister. It was three o\'clock. Jim\'s little sister was coming out of school. He walked along the streets. He looked at his clothes. His rain boots were black. His raincoat was green. His jeans were blue. His umbrella was red. Jim looked around as he walked. People were dressed similarly. The clouds looked dark. They were heavy with rain. Jim walked faster. Jim arrived at 3:20. The school bell would ring at 3:30. Jim needed to wait ten more minutes. He was at the front gate. There were parents waiting alongside with Jim. The school bell rang. Children were escorted to the front gate. Jim\'s sister ran up to him. They hugged, and walked home together.', 'cloudy,raincoat,boots,umbrella,elementary,jeans,dressed,dark,alongside,hugged', 'https://cuoituan.vn/media/hocvui/amthanh_716041311.mp3', 51, 1, 0),
(25, 'His stomach was growling. He had not eaten in five hours. He was starving. He went to his kitchen. He took out a loaf of bread. The bread was made from wheat. It was his favorite bread to eat. He grabbed two slices. He opened the fridge. He gathered all the ingredients. He laid them out across the table. He opened the jar of mayonnaise. It was low-fat mayonnaise. He spread it across the slice of bread. He used a knife to spread the mayonnaise. He unzipped the container of ham. The ham was honey glazed. He grabbed four slices of ham. He put it on the bread slice. He opened the cheese container. He grabbed a slice and put it on top of the ham. He cut some tomatoes and lettuce. He put the vegetables on top of the cheese and ham. He glazed it all with ketchup and mustard. The sandwich was ready for him to eat.', 'stomach,growling,starving,kitchen,wheat,ingredients,slices,mayonnaise,glazed,mustard', 'https://cuoituan.vn/media/hocvui/amthanh_1465030743.mp3', 52, 1, 0),
(26, 'She woke up one morning and felt hungry. She did not eat anything last night. She got out of bed, and walked into her kitchen. The kitchen was clean. She thought about what to eat for breakfast. She opened her refrigerator and took out a carton of eggs. She opened her cabinet, and reached for a bowl. She cracked four eggs into the bowl. She stirred the eggs with a spoon. She turned on the stove, and placed a pan on the stove. She turned the knob on the stove. The fire was lit. She grabbed a stick of butter from the fridge. She tossed the butter on the hot pan. She grabbed the bowl of eggs and threw them on the pan. She scrambled them with a spatula. The eggs cooked in minutes. They smelled delicious.', 'hungry,kitchen,refrigerator,carton,cabinet,bowl,cracked,stove,stick,scrambled', 'https://cuoituan.vn/media/hocvui/amthanh_231996995.mp3', 53, 1, 0),
(27, 'Jason made a new friend. His name is Daniel. Daniel only has one arm. He lost it in a car accident as a child. Jason really enjoyed Daniel \\\'s company. He invited Daniel out with some other friends. Jason was sure the other guys would like Daniel, too. \\\"Meet us at the restaurant,\\\" said Jason. Daniel walked into the restaurant. All the other guys stared at him. Daniel got very nervous. \\\"I hope they don\\\'t make fun of my arm,\\\" he thought. He really wanted to become friends with Jason\\\'s buddies. \\\"Wow,\\\" said one of the guys. \\\"That\\\'s a really nice shirt!\\\" Daniel was relieved. He was invited along every week after that.', 'made,only,lost,accident,other,restaurant,stared,nervous,become,relieved', 'https://cuoituan.vn/media/hocvui/amthanh_1552964235.mp3', 61, 1, 0),
(28, 'Reading a book is fun. Books make you smarter. They also make you a better reader. John loves to read books. He reads books on sunny days. He reads books on cloudy days, and he reads books on rainy days. John has read many books. He read his first book in second grade. His teachers were impressed. John was a good student. He had the highest grades in class. John learned a lot by reading books. He learned new words. He learned new verbs. He learned new adjectives. John reads every day. He has learned about the world. He has learned about history. He has learned about animals. He has learned about people. John loves to learn. He learns something new every day. John has many books. He has large bookshelves. They are full of books. John collects books. He has bought books at bookstores. John wants to read every book in the world.', 'smarter,sunny,cloudy,rainy,grade,impressed,adjectives,animals,bookstores,wants', 'https://cuoituan.vn/media/hocvui/amthanh_973337967.mp3', 62, 1, 0),
(29, 'Brenda wants to have a picnic. She gets a basket. She puts sandwiches in the basket. The sandwiches are healthy. They are also tasty. She drives to the park. She lays out a blanket. She hears a sound. It is raining. She folds the blanket back. She puts the food in the basket.', 'have,gets,sandwiches,healthy,tasty,drives,lays,hears,folds,food', 'https://cuoituan.vn/media/hocvui/amthanh_2008588469.mp3', 23, 1, 0),
(30, 'Joe is a sale associate. He has a lot of duties. He helps customers find things. Customers can be annoying. They always think they\'re right. Joe always has to be nice to them. Joe also answers phone calls. People ask about products in the store.rnrnJoe cleans the bathroom. That\'s the worst part. It\'s very dirty. He has to pick up trash. He has to refill the soap. Joe is also at the cash register. He scans items. He gives people change. He gives back money for returns. He thinks his job is okay, but he plans to quit in a few years.', 'associate, duties,products,cleans,dirty, trash,soap,cash register, items,quit', 'https://cuoituan.vn/media/hocvui/amthanh_1923427952.mp3', 8, 1, 0),
(31, 'Linda loves the park. There is so much to do. First, she looks at the sky. One cloud looks like a dog. Another cloud looks like a sheep. Later, she feeds the ducks. They are hungry. Linda throws bread crumbs. The ducks enjoy the food. Finally, Linda watches the sun go down. It is beautiful.', 'loves,much,looks,cloud,sheep,feeds,hungry,throws,enjoy,sun', 'https://cuoituan.vn/media/hocvui/amthanh_1519358480.mp3', 25, 1, 0),
(32, 'Tom just got hired at the ice cream shop. It was called Creamy Goodness. It was a five-minute walk from his house. Today was his first day on the job. He was nervous. He was also excited. He showed up in his uniform. He was early to the job. He wanted to make a good impression. His first task was to open the shop. He had to prepare the ice cream. He also had to set up the tables and the chairs for the customers. He had to clean all the equipment. He had to make sure everything was ready. His manager helped him get ready. His coworkers also helped. He worked as a cashier. He scooped the ice cream. Tom loved his job.', 'ice cream,nervous,uniform,impression,task,prepare,customers,clean,equipment,cashier', 'https://cuoituan.vn/media/hocvui/amthanh_1890092337.mp3', 63, 1, 0),
(33, 'He goes to class. There is an empty seat in front. He sits in the seat. He looks around. There are different people. He says \"hi\" to the girl next to him. She smiles. The teacher comes in. She closes the door. Everyone is silent. The first day of school begins.', 'diffirent,seat,door,silent', 'https://cuoituan.vn/media/hocvui/amthanh_2065290106.mp3', 2, 1, 0),
(34, 'Casey wants a new car. She needs money. She decides to babysit. She takes care of the child. She feeds him lunch. She reads him a story. The story is funny. The child laughs. Casey likes him. The child\'s mom comes home. The child kisses Casey. Casey leaves. She will babysit him again.', 'wants,needs,to,takes,of,feeds,story,likes,kisses,will', 'https://cuoituan.vn/media/hocvui/amthanh_1606505303.mp3', 4, 1, 0),
(35, 'Joe is a sale associate. He has a lot of duties. He helps customers find things. Customers can be annoying. They always think they\\\'re right. Joe always has to be nice to them. Joe also answers phone calls. People ask about products in the store.rnrnJoe cleans the bathroom. That\\\'s the worst part. It\\\'s very dirty. He has to pick up trash. He has to refill the soap. Joe is also at the cash register. He scans items. He gives people change. He gives back money for returns. He thinks his job is okay, but he plans to quit in a few years.', 'associate,duties,customers,products,cleans,dirty,pick,soap,cash,plans', 'https://cuoituan.vn/media/hocvui/amthanh_483754788.mp3', 64, 1, 0),
(36, 'Kevin asked Michelle on a date. He wanted to go snowboarding. \"I love snowboarding!\" said Michelle. This was a lie. She had never been snowboarding. She wanted to impress Kevin. \"That\'s great!\" said Kevin. \"Then we can go to the advanced slope.\" Michelle was terrified. The top of the advanced slope was extremely high. It was too late to say the truth. \"This can\'t be that hard,\" she thought. \"I just have to keep my balance.\" Michelle flew off the hill. She stayed standing for less than two second. She looked like a giant snowball by the time she reached the bottom of the slope. Kevin felt bad for her. He hugged her tight to get her warm. Her plan worked out after all.', 'on,snowboarding,lie,never,advanced,slope,truth,hill,than,tight', 'https://cuoituan.vn/media/hocvui/amthanh_976337743.mp3', 134, 1, 0),
(37, 'John and his friends were going on a road trip. They were driving from Los Angeles to Washington. John had everything planned out. He had prepared CDs with their favorite songs. They would sing along to them the whole way. He even packed his trunk full of their favorite snacks. John picked up his friends early in the morning. He showed them a map. It was full of dots. \\\\\\\"These are all the stops we should make,\\\\\\\" he said. John wanted to see the Golden Gate Bridge, the Grand Canyon, Old Faithful, and many other monuments. \\\\\\\"What song should we hear first?\\\\\\\" asked John. All his friends were already asleep. They stayed this way the whole trip.', 'road,driving,planned,prepared,along,packed,map,see,monuments,already', 'https://cuoituan.vn/media/hocvui/amthanh_1268989666.mp3', 137, 1, 0),
(38, 'George\'s best friend was visiting him. Joseph lived in Arizona. George moved to Los Angeles two years ago. He hadn\'t seen Joseph since then. George wanted his friend to have fun. He wanted to convince him to move to Los Angeles with him. George had a great idea. He would take his friend to Six Flags. They didn\'t have big roller coasters in Arizona. George and Joseph got on a ride called Tatsu. It was huge and had more than five loops. Joseph screamed more than any other persons. \"Isn\'t this great?\" asked George. \"If you move here, we\'ll be coming here all the time!\" Joseph never returned to Los Angeles again.rnrn', 'was,lived,moved,since,convince,idea,roller coasters,ride,more,screamed', 'https://cuoituan.vn/media/hocvui/amthanh_1287565751.mp3', 138, 1, 0),
(39, 'Kenneth went to the movie theater. He likes to watch action movies. The more action, the better. He waited for his friends. They had planned to meet at 5 p.m. He waited outside. Twenty minutes passed. His friends were not there. He called one of them. It went straight to voicemail. He wondered where his friends were.rnrnHe was getting upset. He called his other friends. They did not answer. He went back to the theater. He bought a ticket. He went to the concession stand. He bought popcorn and soda. He went inside the viewing room. He found a comfy seat. He sat down. He watched the movie all by himself.', 'movie,action,more,planned,passed,called,upset,ticket,popcorn,seat', 'https://cuoituan.vn/media/hocvui/amthanh_1337766917.mp3', 205, 1, 0),
(40, 'Danielle looked in the mirror. Her hair was oily. She needed to wash it. It takes her 30 minutes to wash her hair. But she had a date in 15 minutes. She didn\'t want to look bad though. She got a table cloth. It had pink flowers on it. She wrapped it around her hair.rnrnNow her hair was all covered. She went downstairs. Her brother started laughing at her. He told her to look in the mirror. She looked into a mirror. She looked ridiculous./span> She was jealous of her brother. Her brother had short hair. It only took him 5 minutes to wash his hair.', 'mirror,wash,date,look,cloth,flowers,wrapped,downstairs,ridiculous,short', 'https://cuoituan.vn/media/hocvui/amthanh_823051387.mp3', 206, 1, 0),
(41, 'Cindy needed to return her dress. She tried it on at home earlier. It did not fit her. Today was the last day to return it. After today, she had to keep the dress. The store closes at 8 p.m. She started driving at 7:30 p.m.rnrnIt took her 20 minutes to get to the mall. She only had 10 minutes left to park her car and return her dress. Today was Saturday. There were too many cars in the parking lot. It took her 5 minutes to find a parking space. She ran out of the car, but she did not make it in time. The store was closed.', 'return,at,fit,keep,closes,mall,dress,parking,find,make', 'https://cuoituan.vn/media/hocvui/amthanh_207943169.mp3', 97, 1, 0),
(42, 'Eileen had to see the doctor. She had no appointment. She had to wait for two hours to see the doctor. She was bored. She forgot her phone. She didn\\\'t know what to do. She looked around. Everyone had a phone.rnrnShe looked to see if there were any magazines. Waiting rooms usually had magazines. There were magazines in Spanish. Eileen can\\\'t read Spanish. She turned on the TV. There was no cable. Eileen did not like local television. It was too boring. She turned off the TV. She tried to talk to the person next to her. The person ignored her. He was on his phone. She wished she brought her phone.', 'doctor,appointment,for,bored,forgot,magazines,usually,Spanish,cable,brought', 'https://cuoituan.vn/media/hocvui/amthanh_301000539.mp3', 210, 1, 0),
(43, 'Tom was hungry, but lazy too. He didn\\\'t want to cook. He didn\\\'t want to go to a restaurant. He didn\\\'t even want to heat up leftovers. He decided to have a pizza delivered to him. He went on a pizza website. He ordered a small pizza. He waited for the pizza to arrive.rnrnLater, he heard the doorbell ring. He was too lazy to get up at first. He got up after five minutes. He opened the door. The pizza smelled so good. He paid the delivery man. He gave him a good tip, too. Tom sat back down on his couch. He ate the whole pizza. He was full.', 'lazy,cook,go,heat,decided,ordered,arrive,ring,five,smelled', 'https://cuoituan.vn/media/hocvui/amthanh_1546537765.mp3', 211, 1, 0),
(44, 'Bob had been exercising every day for a year. He had also been eating healthy. He wanted to see how much weight he lost. He stepped on the scale. He closed his eyes. He was scared. What if he gained weight? He opened his eyes slowly. He looked down. He smiled. He lost 50 pounds. He jumped up and down. He wanted to celebrate.rnrnHe went to his favorite burger place. He ordered the jumbo size. He felt bad at first, but he deserved it. He ordered a large size of fries. He used five ketchup packets. He took his first bite. It tasted so good. He would be healthy again tomorrow.', 'every,eating,weight,stepped,scared,slowly,down,burger,jumbo,ketchup', 'https://cuoituan.vn/media/hocvui/amthanh_1318905693.mp3', 212, 1, 0),
(45, 'Marie was messy. Cassie was clean. The two girls were roommates. Marie had a bunch of clothes on her bed. Cassie just had a blanket on hers. Cassie told Marie to put her clothes somewhere else. Marie ignored her.rnrnMarie had food from last week on her desk. It smelled bad. Cassie told her to throw it away. Marie said no. Cassie threw it away herself. Marie yelled at her. She was mad that Cassie touched her things. Cassie yelled at her back. She was mad at Marie for being messy. Marie left and slammed the door. Cassie was all alone. It was a good time to clean.', 'messy,clean,were,bunch,just,put,desk,throw,touched,slammed', 'https://cuoituan.vn/media/hocvui/amthanh_490369456.mp3', 213, 1, 0),
(46, 'Jessica was a college student. She did not know how to cook well. She does not have much time either. She is always busy. She has an important test coming up. She grabs a bowl of instant noodles. Instant noodles are easy to prepare. She rips off the lid halfway. She rips the seasoning packet. The seasoning is what makes the noodles taste good.rnrnShe pours the seasoning on the noodles. She fills the bowl with water. She closes the lid. She puts the bowl in the microwave. She heats it up for three minutes. She sits down. She studies while she waits. She hears the \\\"ding.\\\" It\\\'s ready!', 'college,cook,much,instant,prepare,lid,rips,seasoning,taste,microwave', 'https://cuoituan.vn/media/hocvui/amthanh_876517711.mp3', 214, 1, 0),
(47, 'Alvin wants a new laptop. His parents are poor though. His mom recently lost her job. His dad recently quit his job. Alvin knows that he can\\\'t ask his parents for a laptop. He decides to ask his rich uncle Todd. He drives over to Todd\\\'s house. Todd\\\'s house is beautiful. It has three stories. There is a chandelier on the ceiling. There are expensive paintings all over the place. There are five bedrooms and four bathrooms. Alvin wishes he could live there.rn rnTodd offers him something to eat. Alvin says, \\\"No, thanks. I already ate.\\\" Todd asks him why he is coming. Alvin does not know what to say. He does not want to come off as rude. \\\"My laptop is really old, and I need a laptop for school. I would ask my parents, but they don\\\'t have jobs anymore,\\\" Alvin says.rnrn\\\"I understand,\\\" Todd says. Todd takes out $800 from his wallet and gives it to Alvin. Alvin jumps up and down. He has never felt so happy in his entire life. His mom asks Alvin why he is so happy. Alvin does not say anything. He doesn\\\'t want to make his mom feel bad.', 'laptop,poor,recently,quit,for,rich,chandelier,rude,would,wallet', 'https://cuoituan.vn/media/hocvui/amthanh_1935028464.mp3', 65, 1, 0),
(48, 'It\'s hard to get into college these days. It used to be a lot easier. Now it\'s even not enough to get good grades. You need to have good grades in advanced classes. You need to do some extracurriculars. Extracurriculars are activities you do outside of class such as playing basketball, playing the violin, singing, and more. You need to have a high score on the SAT or ACT. The SAT and ACT are used to test what you know. They both have questions on various subjects.rnrnYou need to have some leadership positions. It is not just enough to be a member in a club. You need to be the president or the vice president. You also need letters of recommendation, letters in which your teachers, coaches, or bosses write about your abilities and personality. It also helps if you won some awards. It shows that you can achieve something.rnrnYou also have to write good essays that show who you are as a person. Colleges want people who have interesting personalities and stories. Students with good grades but boring essays will not get into the college of their dreams. Students should not be sad if they don\'t get into the college of their dreams. They need to know that getting into college is tougher as years go by.', 'into,lot,advanced,some,activities,outside,questions,leadership,personality,essays', 'https://cuoituan.vn/media/hocvui/amthanh_513158506.mp3', 66, 1, 0),
(49, 'Marissa was born with a physical imperfection. She has a unibrow. A unibrow is one long brow. Most people have two eyebrows. People make fun of her for having a unibrow. A lot of people don\\\'t want to be friends with her. She does have two good friends though. Heather and Joe are Marissa\\\'s best friends. They accept Marissa for who she is.rnrnHeather was approached by the popular kids. The leader of the popular kids was Amy. Amy offered Heather a spot in her group if she left Marissa. Heather thought about it. Although she loved Marissa, she always dreamed of being popular. She told Amy that she had to think about the offer.rnrnHeather told Joe what happened. Joe was mad that Heather had to even think about it. \\\"You have been friends with Marissa forever,\\\" Joe said. Heather thought about it. She thought about all the times she and Marissa did homework together, ate together, and laughed together. It wasn\\\'t worth it to give all that up for popularity. She called Amy. \\\"I\\\'m never leaving Marissa, she\\\'s beautiful on the inside.\\\" After talking to Amy, Heather asked Marissa and Joe to hang out', 'physical,unibrow,long,want,popular,spot,mad,times,laughed,popularity', 'https://cuoituan.vn/media/hocvui/amthanh_539134245.mp3', 67, 1, 0),
(50, 'Abby lost her mom yesterday. Her mom got into a car accident. A drunk driver hit her mom\\\\\\\'s car. The drunk driver is now in jail. Abby visited the jail to make him feel bad. \\\\\\\"You know what you did, right?\\\\\\\" Abby asked. The drunk driver nodded and said, \\\\\\\"I\\\\\\\'m sorry.\\\\\\\" He started crying. \\\\\\\"\\\\\\\'Sorry\\\\\\\' is not going to bring my mom back. Your carelessness took away my mom.\\\\\\\"rnrnThe drunk driver continued to cry. \\\\\\\"I drank, because I was feeling lonely.\\\\\\\" Abby was mad and left the jail. She didn\\\\\\\'t want to see his face ever again. She wanted him to go to jail for life. Abby could barely wake up. She requested to take a week off her work. She loved her job, but she could not stop thinking about her mom.rnrnAbby\\\\\\\'s husband told her to do something instead of watching TV all day. Abby agreed with him. It was time for her to start doing something productive. She wanted to do something that would make her mom proud. Abby created a program to prevent drunk driving. She wanted to give drunk people free rides. Abby visited colleges, clubs, and bars all across the country to encourage people not to drive when drinking.', 'lost,car,jail,nodded,cry,barely,job,stop,instead,clubs', 'https://cuoituan.vn/media/hocvui/amthanh_161277656.mp3', 68, 1, 0),
(51, 'Kelly has been cheering since she was in elementary school. She is now in her last year of college cheering for her school\\\'s sports teams. She plans to be a professional cheerleader for the Lakers team. That was her dream. Her parents wanted her to do something more normal, like becoming a nurse or working at a law firm. Kelly ignored her parents.rnrnKelly and her teammates were cheering at their last basketball game. When Kelly stood on top of her teammate\\\'s shoulder, she fell down. Everyone was silent. Her teammates checked up on her and asked if she was okay. Kelly had to be taken to the hospital. Her leg was permanently injured. \\\"Can I ever be a professional cheerleader?\\\" she asked. \\\"I\\\'m afraid you cannot,\\\" the doctor said. Kelly felt that life was unfair.rnrnKelly was scared for the future. All of her friends already knew what they wanted to do after college. Kelly had to change her plans. She already canceled her audition with the Lakers cheerleaders. Kelly thought about what she wanted to do for a career. She still wanted to do something related to cheer. After some thinking, Kelly wanted to be a coach for high school cheerleaders.', 'cheering,college,dream,basketball,shoulder,hospital,unfair,scared,already,related', 'https://cuoituan.vn/media/hocvui/amthanh_1148896615.mp3', 69, 1, 0),
(52, 'Kimberly seems like a normal teenage girl. She goes to high school; she has homework; she has problems with the popular girls; she argues with her parents. However, Kimberly has a secret power. She has super strength. She can lift up cars from the ground. She uses her strength to fight crime in her city. She has even been on the news!rnrnKimberly hides this secret from everyone except her younger brother and her parents. She doesn\\\'t want people to treat her differently. She feels that people might give her special treatment because she is a hero. She wants people to see her for who she truly is. To hide her identity, she wears a mask and green colored contacts. Her superhero outfit includes a cape and a stretchy purple suit.rnrnSometimes Kimberly does want to tell people she is a superhero, like when she was bullied by the popular girls. She came close to telling them one time after they destroyed her science project. Kimberly also has a sidekick who is her best friend. His superhero name is OttoBot, and his real name is Oliver. His power is his super speed. Oliver goes to the same school as Kimberly, but he does not keep his identity a secret.', 'normal,popular,super,hides,treat,truly,wears,superhero,destroyed,science', 'https://cuoituan.vn/media/hocvui/amthanh_1455755357.mp3', 70, 1, 0),
(53, 'Anna has a lucky jacket. Whenever she wears it, good things happen to her. She wore it on her final exam one time, and she got the highest grade in the class! The jacket is green with yellow stripes. It\\\\\\\'s really smelly, because Anna never washes it. She is scared that washing the jacket will wash away the luck. She keeps the jacket in a closet all by itself. No other clothes are in the closet.rnrnAnna had an important interview for a job. She was very nervous about it. She wanted to wear the jacket, but the jacket was not appropriate for the interview. She needed to wear nice clothes. She decided to wear the jacket under a plain gray sweater. Perfect plan, she thought.rnrnWhen Anna entered the interview room, she started to sweat. She wondered why it was so hot. She realized that the heater was on. She sat down across from the interviewer. \\\\\\\"Anna, you\\\\\\\'re sweating. You should take your sweater off.\\\\\\\" Anna laughed nervously. \\\\\\\"I\\\\\\\'m fine,\\\\\\\" she said. By the end of the interview, there was a sweat stain on Anna\\\\\\\'s sweater. She left the interview feeling unsure. A week later Anna got a phone call from the boss. The boss offered her the job! The lucky jacket worked!', 'jacket,exam,grade,other,interview,appropriate,decided,sweat,realized,nervously', 'https://cuoituan.vn/media/hocvui/amthanh_1500963492.mp3', 71, 1, 0),
(54, 'Ten years ago, most adults had regular cell phones. Now people have smartphones. With smartphones, you can not only call people, but you can also go online, download new games, calculate a math problem, organize your schedule, and more. Smartphones are really helpful. Even kids have cell phones now.rnrnPeople use their phones a lot these days, especially when they are waiting. People do not like to be bored, so they go on their phones. A lot of news reports are saying that people are looking at their phones way too much. People look at their phones when they are with others, and that is bad. Being addicted to something is never good.rnrnWhen you go into a restaurant and look at other customers, most of them have phones in their hands. They would rather text, play a game, or go online than talk to the people around them. Some restaurants have even offered a free meal or a discount if customers are willing not to use their phones for an entire hour! People also use their phones before they sleep. This is bad for them, because it makes it harder for them to go to sleep. The light from the phone tricks our bodies into thinking we need to be awake.rnrn', 'adults,call,calculate,really,bored,reports, bad,restaurant,offered,entire', 'https://cuoituan.vn/media/hocvui/amthanh_110435225.mp3', 72, 1, 0),
(55, 'The terrorist attacks have scared a lot of people from studying abroad. Many students go to big cities to take pictures, shop, and explore. Terrorists attack these big cities though, because they know that there will be a lot of people. The truth is, we should not stop people from studying abroad. These terrorist attacks can happen anytime. We can\\\\\\\\\\\\\\\'t live life in fear. We must do the things we love.rnrnPeople are also scared to travel in general, because of plane accidents. Terrorists often bring explosives on planes. Some people are also scared of dying on a plane. All the passengers in Malaysia Airlines Flight 370 are missing. We still don\\\\\\\\\\\\\\\'t know what happened to them. Not too long after, all the passengers in Malaysia Airlines Flight 17 died. It was a very tragic event.rnrnIt is scary that our lives can end so quickly and suddenly. We need to live life to the fullest. We need to love the people around us and be thankful for every day that we live. There are always news stories about people dying before they should. It\\\\\\\\\\\\\\\'s not the best thing to hear about, but it makes us more aware of our own lives.', 'attacks,lot,happen,fear,accidents,passengers,tragic,quickly,around,stories', 'https://cuoituan.vn/media/hocvui/amthanh_1933642872.mp3', 73, 1, 0),
(56, 'Brenda has to make an important decision. She got accepted to an internship in France; she also got a job offer at a hospital. She can only do one though. She made a list of pros and cons. Pros are the good things while cons are the bad things.rnrnThe internship in France was good, because Brenda always wanted to go to France. Her plane tickets and living accommodation would be paid for. The bad thing about the internship was that it had nothing to do with her life goals. The internship required her to teach French children English. Brenda was okay with children, but she didn\\\'t love them.rnrnOne pro of the job offer at the hospital was that it was good for her end goal. Brenda\\\'s end goal was to be a doctor, and the job will teach her a lot about medical school. One con of the job offer was the location. The hospital is in a dangerous place where people have to be careful of being robbed and getting hurt. After a lot of thinking and looking at her list, Brenda decided to work at the hospital. She knew that working there would be good for her future.', 'important,internship,offer,pros,accommodation,nothing,required,teach,location,dangerous', 'https://cuoituan.vn/media/hocvui/amthanh_1767604929.mp3', 74, 1, 0),
(57, 'A different hairstyle or color can change a person\\\\\\\'s entire look. It can make a person look better or worse. Jean was about to enter her first day of college. She wanted a new look. Her current hairstyle was nice, but it was boring. She had it since she was a 9th grader. Her hair right now was straight, long, and blonde. She went into the hair salon and asked the hairstylist.rnrn\\\\\\\"What kind of look are you going for?\\\\\\\" the hairstylist asked. \\\\\\\"I want to look like a model,\\\\\\\" Jean said. \\\\\\\"Well, we can add layers to your hair. We can also make your hair more blonde,\\\\\\\" the hairstylist said. \\\\\\\"That sounds good!\\\\\\\" Jean said. Jean sat in the chair while the hairstylist cut her hair. Jean couldn\\\\\\\'t see herself in the mirror because she didn\\\\\\\'t have her glasses on. She just trusted the hairstylist. An hour later, the hairstylist said, \\\\\\\"Done!\\\\\\\" Jean put on her glasses and looked at herself. She looked totally different! She liked it, but felt strange. She could barely even recognize herself.rnrnJean asked her friends and family what they thought. Most of them liked it. They said it made her look edgier but very different. In fact, when she met up with her friends, they asked who she was. One of them even tried calling the police when Jean showed up in front of her house.rnrnWhen Jean was shopping with her friends at the mall, a model scout came up to her and asked if she would consider modeling. Jean said she would think about it and took his business card. The new hairstyle was really working out for her.', 'hairstyle,person,blonde,layers,mirror,totally,edgier,tried,mall,business', 'https://cuoituan.vn/media/hocvui/amthanh_1484612571.mp3', 232, 1, 0),
(58, 'Kelly\\\'s favorite holiday is Halloween. She loved pumpkin pie, pumpkin spice latte, dressing up, scary movies, and trick-or-treating. The sad thing, however, is that Kelly knows that she is too old for trick-or-treating. She is now 21 years old. She loved how she could get different kinds of candy for free.rn rnThis Halloween, Kelly was going to babysit her 10 year-old cousin Albert and his friends. Kelly dressed up as a pirate. Her cousin and his friends dressed as ghosts. Albert and his friends made Halloween themed cupcakes. The frosting was orange and the sprinkles on top were black. Afterwards, they carved pumpkins. Albert asked, \\\"What should we do now, Kelly?\\\" \\\"Why don\\\'t you go trick-or-treating?\\\" she suggested. \\\"I\\\'m too scared to talk to strangers,\\\" Albert said. \\\"Don\\\'t worry, I will go with you!\\\" Kelly said.rnrnAll of them went to the house to the right. They knocked on the door and said \\\"Trick-or-treat!\\\" The couple smiled and gave the kids a chocolate bar. Kelly wished they gave her one. They went to the next house and the family there gave them gummy worms. The next house they went to was interesting. The couple there gave them money! Kelly definitely wanted some money.rnrnThey went to a total of 10 houses and got more than 10 different types of candy. They all went back to Kelly\\\'s house. Kelly was sad looking at all their candy. Then, Albert and his friends gave Kelly a hug and said they loved hanging out with her.', 'pumpkin,spice,knows,babysit,orange,black,smiled,gummy,definitely,hug', 'https://cuoituan.vn/media/hocvui/amthanh_2037280976.mp3', 233, 1, 0),
(59, 'Ophelia was a night shift worker at a hospital. This meant that she worked late at night. Ophelia\'s work schedule was 9 p.m. to 4 a.m. Ophelia would sleep during the day while most people were at work. For the first year of work, Ophelia had a hard time adjusting to the schedule. She had trouble sleeping during the afternoon. She was upset that she had to miss out on social events her friends hosted.rnrnIt\'s still hard for Ophelia to adjust, but she is better at it. When she comes back from work, she goes to the gym for a few hours. Then, she practices her knitting skills. Afterwards, she would make herself a healthy meal. Night shift workers often eat unhealthier than day shift workers. After lunch, she would watch her favorite TV show. After that, she would sleep.rnrnThe hospital informed the employees that they could send requests to change the time of their shift. Ophelia was excited about this and immediately sent in a request to change her shift. A couple of weeks later, the manager gave Ophelia a letter. The letter stated that her request was rejected. Ophelia was shocked. She went to her manager and asked him why. He said that many night shift workers who requested an earlier shift were elderly. Ophelia was only 25. The manager thought that the older employees needed an earlier shift more than Ophelia did. Ophelia was mad at first, but she thought about the older employees. Their bones were aching and they\'re tired. They do need it more than her.', 'shift,schedule,upset,adjust,gym,lunch,employees,excited,manager,older', 'https://cuoituan.vn/media/hocvui/amthanh_820565613.mp3', 234, 1, 0),
(60, 'Janice is turning 21 today. Originally, she wanted to go to Las Vegas to celebrate. A lot of people go to Las Vegas for their 21st birthday because in the United States you can legally drink at 21. However, Janice decided not to go because she wanted to save money to buy a new car. Janice decided that she just wanted to go to a nice restaurant with her friends.rnrnJanice\\\'s birthday was on a Tuesday, and she had class and work on Tuesdays. She always walked to class with her friend Austin. When she and Austin met up, she thought he would wish her a Happy Birthday, but he didn\\\'t. Austin has known her for years and he would always remember her birthday. Janice tried to drop hints. \\\"I wonder what today is,\\\" she said. \\\"Just a Tuesday, nothing special.\\\" Janice was upset. She ignored him during class.rnrnAfter class, Janice went to work. She expected a few birthday cards or a cake, but nothing. She was surprised, because employees would always get something for their birthdays. This made Janice upset. She didn\\\'t even want to go out to eat for her birthday anymore. When Janice got home, she questioned if anyone even cared about her. Her friend Liza called her. \\\"Hey, can you open the door, we\\\'re here,\\\" Liza said. \\\"I don\\\'t want to go out anymore,\\\" Janice said. \\\"Why not? Can you just open the door, we\\\'re already here,\\\" Liza said. Janice opened the door. \\\"Surprise!\\\" her friends yelled. They had a puppy in their hands.', 'celebrate,legally,money,work,walked,drop,cards,employees,even,puppy', 'https://cuoituan.vn/media/hocvui/amthanh_454698791.mp3', 235, 1, 0),
(61, 'Kathy, Denise, Lauren, Andre, Harrison, and David are best friends. They all live in San Francisco. They live in different places and have different jobs, but at the end of their work day, they would meet up in the same cafe. They also had different personalities, but somehow they make it work. Kathy is a struggling writer. She is working on a fantasy novel and trying to get it published. Denise is a medical student at the University of California, San Francisco. Lauren is a TV screenwriter. Andre is also a medical student at the University of California, San Francisco. Harrison is an investment banker. David is a graphic designer.rnrnHow did they all meet? Kathy and Denise were friends in college and they moved to San Francisco together. They bumped into Lauren at a wine tasting event. The three of them became friends. Denise met Andre at medical school and Denise invited Andre to hang out with Kathy and Lauren at the museum. Lauren\\\'s cousin is Harrison. Harrison wanted a website for the company he worked at and hired David to design it. Lauren invited Harrison and David to come to the museum, too. When the six of them met up, they instantly became friends.rnrnSometimes their different personalities caused fights. Kathy was shy and traditional. Denise was outspoken. Lauren was kind but also naive. Andre was funny. Harrison was smart but also greedy. David was bossy but also caring. Even though they were different, though, they all cared about each other.', 'are,places,struggling,medical,college,bumped,cousin,website,shy,bossy', 'https://cuoituan.vn/media/hocvui/amthanh_1715521361.mp3', 236, 1, 0),
(62, 'Eddie and Cynthia both went to the same high school. They had liked each other since ninth grade. Eddie and Cynthia met in math class. Cynthia was really good at math. She always scored the highest out of everyone. Eddie was having trouble with math. He kept getting Fs. If he didn\\\'t bring his grade up to a C, he would have to repeat the class. The teacher asked Cynthia to help Eddie out for extra credit, and she said yes. Every day after school for two hours, Cynthia would help him. Eddie fell in love with her. He ended up with a B in the class. Eddie took Cynthia out to dinner to thank her.rnrnAt dinner, they both fell for each other. They started dating. Everything was good. They never had fights and even talked about getting married one day. When senior year came around, though, they had to apply to college. They didn\\\'t want to stop each other from going places, but they both wanted to stay together. Cynthia got into Harvard and wanted to major in math. Eddie did not get into Harvard. He got accepted to a school near Harvard but thought it would be better for him to stay closer to home. Cynthia ended up going to Harvard and Eddie ended up going to Florida State University. They tried to have a long distance relationship, but it was hard. They broke up after their first year of college. After they graduated, however, they both worked in Florida. They got back together.', 'both,math,scored,credit,dinner,started,senior,major,closer,graduated', 'https://cuoituan.vn/media/hocvui/amthanh_786488104.mp3', 237, 1, 0),
(63, 'Ruby always looked up to her cousin Wanda. Ruby was an only child in her family, so she saw Wanda as an older sister. Wanda was beautiful, smart, and talented. She had straight As, played the piano, and had so many friends. Wanda also had a great sense of style. It was classy yet cute. Ruby was still in high school but she knew she wanted to go to the same university as Wanda did.rnrnWanda knew that Ruby looked up to her and she appreciated that. For Christmas, Wanda got Ruby a sweater with her university\'s logo on it. Ruby was so happy when she got the sweater. She put it on immediately and wore it almost every day. One day in class, Ruby raised her hand to answer the teacher\'s question and the teacher accidentally called her Wanda. \"I\'m sorry, you just look a lot like her,\" the teacher said. \"Don\'t apologize, I\'m flattered\" Ruby said. Ruby was even in the same clubs in high school as Wanda was. Sometimes people made fun of Wanda for not having her own personality. However, the truth was Ruby was different from Wanda. Ruby was more goofy and girly.rnrnWhen college admission decisions came out, Ruby was so anxious to check the website to see if she got in. She closed her eyes and slowly opened them. She found out she got accepted! She called Wanda to thank her for reading her application. The next day Wanda took Ruby to look at the school.', 'cousin,as,sense,appreciated,immediately,accidentally,girly,decisions,anxious,took', 'https://cuoituan.vn/media/hocvui/amthanh_1137228800.mp3', 238, 1, 0);
INSERT INTO `ad_nghebai` (`id_nghe`, `nghe_content`, `nghe_dapan`, `nghe_music`, `id_bai`, `congkhai`, `xoa`) VALUES
(64, 'Nicole was always insecure about herself. She didn\\\\\\\'t like how she looked. She thought she was too tall and skinny. People would always ask her how tall she is. She tried to gain weight, but she never could. Most people would love to be in Nicole\\\\\\\'s situation though. Nicole didn\\\\\\\'t like how she was so shy. She wished she could easily talk to people and make new friends. Nicole didn\\\\\\\'t like her voice. She thought it was too low.rnrnNicole\\\\\\\'s confidence was so low that her friends started to get annoyed with her. They kept telling her that she was fine, but Nicole would deny it. Nicole\\\\\\\'s mom encouraged her to join a sports team at school. Nicole did not want to, because she didn\\\\\\\'t want to get rejected. After days of convincing, Nicole finally gave in to her mother\\\\\\\'s request. Nicole decided to try out for the basketball team. She played when she was younger, but has not played in five years. It helped that Nicole was tall.rnrnWhen Nicole went to try-outs, she looked at all the people she was competing against. She started to compare herself to the other girls. They were all shorter than her, but they were more confident. Nicole tried to put them out of her mind. The coach asked the girls to shoot free throws, run short distance, and then finally, asked them to play a game. Nicole was doing well, and she was surprised. She didn\\\\\\\'t realize that she still had basketball skills. Nicole made the team and felt more confident about herself. She knew she was good at something.', 'insecure,skinny,situation,confidence,telling,rejected,decided,competing,confident,surprised', 'https://cuoituan.vn/media/hocvui/amthanh_451426570.mp3', 239, 1, 0),
(65, 'Edward really liked Natalie. The Sadie Hawkins dance, where girls ask guys out, was coming up. In other dances, guys usually ask girls out. Natalie liked Edward, too, but he did not know. Natalie was thinking about asking Edward to the dance, but she was shy. Her friends eventually convinced Natalie to ask him.rn rnDuring the lunch break, Natalie and her friends went up to Edward at his usual lunch table. \"Hi Edward. This song is for you,\" Natalie said. He looked shocked. Natalie took out her guitar. Her friends took out their instruments, too. Natalie played an original song. The song was about how they met on the first day of 9th grade. At the end of the song, Natalie asked, \"Will you go to Sadie with me?\" There was a long pause. Everyone around Edward was waiting for his response. Edward said yes, but he didn\'t look too happy.rnrnAfter school, Natalie asked Edward why he looked upset when she asked him out. \"I really like you, but I\'m not a dancer,\" Edward said. Natalie laughed. \"Who cares? No one is really good at dancing. The important thing is that you have fun,\" Natalie said. Edward nodded and decided to go out with her. At the dance, Edward felt awkward at first. Then, Natalie started dancing and it was bad. Edward laughed and started dancing, too. Even though they were both awkward, they had fun.', 'dance,usually,shy,break,guitar,grade,pause,upset,important,awkward', 'https://cuoituan.vn/media/hocvui/amthanh_124080080.mp3', 240, 1, 0),
(66, 'Mildred was very superstitious. She believed that black cats and walking under ladders were unlucky. Her friends and family would make fun of her for being so superstitious. Her brother tried to explain to her that superstitions are not real. She never believed him though. There have even been times where she went out of her way because of superstitions.rnrnOne time, Mildred was very scared to take a math test. There is a superstition that says that carrying a rabbit foot brings good luck. Although Mildred could not get a real rabbit\'s foot, she brought a key chain of a rabbit foot. Another time, Mildred\'s friends invited her to get pizza at a new restaurant. Mildred was about to go inside the restaurant when she saw the restaurant\'s phone number included \"666.\" \"666\" is considered to be unlucky, so she left.rnrnAnother time, it was raining pretty hard. When Mildred went into the mall, she noticed that a woman still had her umbrella opened! An open umbrella indoors is supposed to be bad luck. She ran up to the woman and asked if she could close her umbrella. The woman looked at her with a disturbed face. \"Don\'t tell me what to do,\" she said. The woman continued walking around the mall with her umbrella opened just to annoy Mildred, who wanted to leave the mall immediately to avoid any bad luck. Her mom convinced her to stay. \"Mildred, nothing bad is going to happen,\" she said. Mildred stayed in the mall for four hours. Her mom was right. Nothing bad happened', 'superstitious,ladders,believed,scared,brought,considered,mall,supposed,umbrella,immediately', 'https://cuoituan.vn/media/hocvui/amthanh_1310862439.mp3', 241, 1, 0),
(67, 'Sea World is one of the most famous parks in the world. Thousands of people visit each year. Most of them go to see the dolphins and whales perform tricks. This is something they could never see in the wild. Sea World has been under a lot of pressure lately. Thousands of people have been protesting the parks. These people say that dolphins and whales should not be forced to live in such small spaces. They should also never be forced to perform pointless tricks. Most people are starting to agree with this. Sea World will hopefully start listening to the protesters soon.', 'famous,dolphins,never,pressure,protesting,such,forced,pointless,agree,hopefully', 'https://cuoituan.vn/media/hocvui/amthanh_1935118095.mp3', 299, 1, 0),
(68, 'Helen had nothing to do one Saturday night. \"Let\'s go to a Drive-In theatre,\" said Donna. Helen had no idea what that was. Donna told her she would love it. Helen agreed to go. Drive-In theatres play movies outdoors. People park their cars in front of a giant screen. They each get a pair of speakers. Everyone watches the movie from their cars. Helen had seen many of them in old movies. \"This is where people used to go on dates,\" she said. She had no idea they still existed. The girls watched a horror movie. It was scarier than watching it in a room with a bunch of people. \"They should bring these back,\" said Donna', 'to,idea,love,agreed,movies,speakers,from,seen,existed,bunch', 'https://cuoituan.vn/media/hocvui/amthanh_1255413423.mp3', 300, 1, 0),
(69, 'He wakes up. He sees the sun rise. He brushes his teeth. His teeth are white. He puts on his clothes. His shirt is blue. His shoes are yellow. His pants are brown. He goes downstairs. He gets a bowl. He pours milk and cereal. He eats. He gets the newspaper. He reads.', 'wakes,sees,brushes,are,puts,shoes,goes,gets,milk,newspaper', 'https://cuoituan.vn/media/hocvui/amthanh_653367799.mp3', 15, 1, 0),
(70, 'Steven loved almost everything about his grandma. There was only one thing he hated. She always knitted sweaters for him. Steven understood that she did it to be nice. However, all the sweaters were very ugly. Steven visited her once a week. She had a new sweater for him each time. Steven lived in a small apartment. There was no room for him to keep all the sweaters. He had to give all of them away. \\\"Grandma will never find out,\\\" he thought. One day, Steven\\\'s grandma visited him by surprise. She asked to see his sweaters. \\\"Someone stole all of them!\\\" he said. \\\"They were too nice.\\\" She made him ten more by the next month.', 'almost,only,knitted,understood,very,visited,small,never,stole,ten', 'https://cuoituan.vn/media/hocvui/amthanh_663125921.mp3', 75, 1, 0),
(71, 'Dorothy had very curly hair. She hated it. \\\"It\\\'s too big,\\\" she always complained. Dorothy wanted to be an actress. All the actresses she knew had straight hair. It always looked perfect and smooth. Every morning, Dorothy was up at 5:00 a.m. She spent two hours straightening her hair. One morning, Dorothy had a big acting audition. She was running very late. There was no time to straighten her hair. \\\"I\\\'m never going to get the job with this hair,\\\" she thought. She was wrong. As soon as the director saw Dorothy, she was hired. \\\"Your hair stands out so much,\\\" he said. \\\"You must love it!\\\" \\\"Of course I do!\\\" replied Dorothy.', 'curly,hated,always,actresses,perfect,up,straightening,time,wrong,replied', 'https://cuoituan.vn/media/hocvui/amthanh_1474023559.mp3', 76, 1, 0),
(72, 'Lisa grew up in a huge family. She had six older sisters. All of them were very beautiful. This made Lisa feel very bad. She knew she looked nothing like them. Lisa had even heard people say she was the ugly sister. As teens the girls spent every weekend out on dates. Lisa always stayed home alone. Her sisters spent their days combing their hair and putting on makeup. Lisa spent her days reading and studying. Her sisters laughed at her a lot. As adults, all her sisters got married young. They all had handsome husbands with no brains or jobs. Lisa went to college. She became a rich scientist and traveled the world. She was the one laughing now.', 'grew,older,very,knew,heard,ugly,stayed,reading,married,traveled', 'https://cuoituan.vn/media/hocvui/amthanh_1460986761.mp3', 79, 1, 0),
(73, 'Robert\\\'s family got together every Sunday. They always had lunch together. Every week, they went to the same restaurant. It was an \\\"All-You-Can-Eat Buffet\\\". Robert\\\'s family loved eating. This was the perfect restaurant for them. Robert\\\'s mom always ate the most. She would serve herself at least four plates for one meal. His dad was a picky eater. The buffet gave him plenty of options. Aunt Nancy loved the buffet the most. She always brought a bag with her. She would make sure no one was looking at her. Then, she would drop food into the bag. Her bag was three times bigger than before by the time she left.', 'together,always,went,was,loved,perfect,ate,plates,buffet,drop', 'https://cuoituan.vn/media/hocvui/amthanh_9644398.mp3', 301, 1, 0),
(74, 'Cindy needed to return her dress. She tried it on at home earlier. It did not fit her. Today was the last day to return it. After today, she had to keep the dress. The store closes at 8 p.m. She started driving at 7:30 p.m.\\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\n\\\\\\\\\\\\\\\\r\\\\\\\\\\\\\\\\nIt took her 20 minutes to get to the mall. She only had 10 minutes left to park her car and return her dress. Today was Saturday. There were too many cars in the parking lot. It took her 5 minutes to find a parking space. She ran out of the car, but she did not make it in time. The store was closed.', 'needed,tried,fit,was,keep,minutes,left,park,parking,out', 'https://cuoituan.vn/media/hocvui/amthanh_1706452476.mp3', 209, 1, 0);
