(35, 11, 'There are seven questions in this part. For each question there are three pictures and a short recording. For each question, choose the correct answer (A, B or C).', 'amthanhchl_1133594955.mp3', '', 'Nghe', 1, 0, 'There are seven questions in this part. For each question there are three pictures and a short recording. For each question, choose the correct answer (A, B or C).<br/>Before we start, here is an example.<br/>Where is the girl’s hat?<br/>Mum: where ‘s your new hat, Sally? I hope you haven’t left it on the school bus.<br/>Sally: Don’t worry, Mum. I put it in my school bag because I was too hot.<br/>Mum: Are you sure? I can’t see it there. You probably dropped it in the road somewhere.<br/>Sally: Oh, here it is – hanging in the hall. I forgot take it this morning.<br/>[pause]<br/>The answer is A.<br/>Look at the three pictures for question 1 now.<br/>[pause]<br/>Now we ready to start. Listen carefully. You will hear each recording twice.<br/>One. Which dish di Mark cook in the competition?<br/>Woman: So you’ve won the teenage chef competition, Mark – congratulations!<br/>Mark: Thanks! In the competition, you choose whether to cook a meat, fish or vegetarian dish; then you ‘re judged on the taste and how attractive it looks. I couldn’t decide between fish and vegetables – I’ve never been brilliant at meat dishes. Then I found the judge was an expert in cooking fish, which worried me, so I went for my other choice – and won!<br/>Two. Where is the girl’s book now?<br/>Girl: Excuse me. I think I left my book on this table – have you seen it?<br/>Man: Oh yes. I took it inside with the empty glass when I cleared the table. I gave it to the manager, who put it with the other lost property. He keeps it all in the drawer of his desk.<br/>Girl: I see. Where is he now?<br/>Man: He’s on the phone inside the café. Why don’t you go inside – he’ll be finished in a minute.<br/>[pause]<br/>Now listen again.<br/>[pause]<br/>Three. Who lives with Josh in his house?<br/>Girl: Does your house seem empty now your sister’s left home, Josh?<br/>Josh: Not really. My grandmother’s move into her room, and she doesn’t go out much. It’s really nice having her there because my dad never comes home until later, and if my mum’s out for the evening. Grandma cooks supper for me.<br/>[pause]<br/>Now listen again.<br/>[pause]<br/>Four. What will the girl take with her on holiday?<br/>Boy: Have you packed for your holiday?<br/>Girl: No, I need to go shopping before I can do that. Last holiday, my suitcase handle got broken, so I need something new to put all my stuff in. But suitcases are so heavy to carry.<br/>Boy: I always take a backpack – you can carry more that way.<br/>Girl: Yes, I thought about one of those, but good-quality ones are expensive. I’ll get one of those big sports bags. You know, one you can pull along. They don’t cost much, so it doesn’t matter if it gets torn.<br/>[pause]<br/>Now listen again.<br/>[pause]<br/>Five. What time will the train to Manchester leave?<br/>Man: The train arriving at platform six is the 11.45 from Manchester. The train due to arrive at platform four in approximately five minutes is the delayed 11:30 train to Manchester. The train will now depart at 11.50 and travel none-stop. We apologize to passengers for the delay. Refreshments will not be available on this train.<br/>[pause]<br/>Now listen again.<br/>[pause]<br/>Six. Where will the friends meet?<br/>Kimberley: Hi, it’s Kimberley. I go your message and I’d love to go to the movies. There ‘s a film called SpyGame, or a comedy – I don’t mind which … Shall we meet outside the cinema?<br/>Girl: Or, I know, at the burger bar on the corner. We could have a snack before we go in or we could meet at the bus station.<br/>Kimberley: Mum’s driving me into town this afternoon, to buy some trainers, so I won’t be near the station. But something to eat first is a good idea. Shall we say 6 o’clock?<br/>Girl: OK<br/>[pause]<br/>Now listen again.<br/>[pause]<br/>Seven. Which sport will the boy do soon at the centre?<br/>Boy: Have you been to the new water sports centre yet?<br/>Girl: Oh yes, It’s brilliant. There are two indoor pools, one for underwater diving, and one for swimming, and you can also have sailing lessons on the lake.<br/>Boy: That’s what I’m doing there next weekend, actually. I was hoping to take waterskiing lessons, but the leaflet says they ‘re not starting those until next year.<br/>[pause]<br/>Now listen again.<br/>[pause]<br/><br/>'),
(36, 11, 'You will hear an interview with a singer called Nick Parker who plays in a band called Krispy with his sister Mel.<br/>For each question, choose the correct answer A,B or C.<br/>', 'amthanhchl_1070154571.mp3', '', 'Nghe', 1, 0, 'Now turn to Part 2, questions 8 to 13.<br/>You will hear an interview with a singer called Nick Parker who plays in a band called Krispy with his sister Mel.<br/>For each question choose the correct answer A, B, or C.<br/>You now have 45 seconds to look at the questions for Part2.<br/>[pause]<br/>Now we are ready to start. Listen carefully. You will hear the recording twice.<br/>Int: I’m talking to Nick Parker, the singer with the band called Krispy. Nick Your sister, Mel plays guitar in the band too, doesn’t she?<br/>Nick: Yeah, Mel’s a year younger than me. We’ve been playing and singing together since we were … eight, nine. Dad is a guitarist and took us to hear the great bands playing live. Mel and I put on shows at school, which was a lot of fun. Mum thought we were good, but she didn’t want us to get too serious about our music because of the hard lives professional musicians have.<br/>Int: When did you start writing music?<br/>Nick: I’ve been written since I was ten. And later Mel started working with me. We didn’t have the same influences – I liked rock music and she loved world music, especially bands from Africa. But we found good ways of mixing the styles.<br/>Int: Your band, Krispy, has two guys and two girls in it. How was it formed?<br/>Nick: Mel and I were playing in a concert at our college and there were two students from music school in the audience. They came to see us after the show and asked if we ‘d like to form a band with them. We weren’t sure at first because we were much younger than them. But we agreed to try it out and it was brilliant.<br/>Int: was the band an immediate success?<br/>Nick: well, we spent the first year practicing and writing music. During that time, we all had studying to do. We played in local concerts and the audiences enjoyed what we did. Then during one holiday we recorded two songs and sent them to a music company. They offered us a contract, but our parents said we had to finish college first.<br/>Int: You’ve been together a few years now nad you’re one of the top bands. What ‘s that like?<br/>Nick: Hard work. We travel to concerts all round the world and are never in one place for more than a few nights. The others are like an older brother and sister to me and Mel, which is good. They help us relax on our days off, and make sure we eat well. They ‘re strict about practicing too.<br/>Int: Have you had any disappointments?<br/>Nick: Everthing we’ve recorded has done well. Three singles have one to number one and our first album has sold over a million copies. Our second album was due out this winter, but I’ve been ill recently so we ‘ve started recording late which is a pity. But for the rest, everything’s fine.<br/>[pause]<br/>Now listen again.<br/>That is the end of Part 2.<br/>'),
(37, 11, 'Look at the six sentences for this part.<br/>You will hear a boy called Ruby talking about a poster for their school sports day. Decide if each sentence is correct or incorrect.<br/>If it is correct, choose the letter A for YES. If it is not correct choose the letter B for NO.<br/>', 'amthanhchl_650221186.mp3', '', 'Nghe', 1, 0, 'Now turn to Part 4, question 20 to 25<br/>Look at the six sentences for this part<br/>You will hear a boy called Thomas and a girl called Ruby talking about a poster for their school sports day.<br/>Decide if each sentence is correct or incorrect. If it is correct, choose the letter A for YES. If it is not correct, choose the letter B for NO.<br/>[pause]<br/>Now we are ready to start. Listen carefully. You will hear the recording twice.<br/>Thomas: So, Ruby, what about this poster for the school sports day. How shall we start?<br/>Ruby: Well, Thomas, I think we should draw a rough copy on this paper first and then do afinal copy when we’ve got everything right.<br/>Thomas: Good idea. Well, let’s get a bigger piece of paper … that papers’ too small.<br/>Ruby: I think last year’s poster was 40 centimetres by 60 centimetres.<br/>Thomas: That was a good size, so there’s no reason to change it and we ‘ll make it black and white again. I think that looks best.<br/>Ruby: But wouldn’t it be a good idea to show that our new sports colours are purple and yellow?<br/>Thomas:That’s a good point but think of the cost!We need to do at least 20 photocopies.<br/>Ruby: Oh, I forgot about the money … of course. So, what sall we put at the the top of the poster? Do you think we should have our school name there?<br/>Thomas: I’d prfer it in the centre so that it’s the first thing people notice.<br/>Ruby; That’s where the photograph should go, I think. And then we can put the date and the time underneath it.<br/>Thomas: Ok, which picture are we going to user?<br/>Ruby: Well, there are three here. This one of the football team isn’t very good. And this one’s took dark.<br/>Thomas: I prefer this photo taken last week of the base ball game. It’s a very popular new sport at our school.<br/>Ruby: Fine. So that just leaves how to write the words. Do you think we should use all capital letters?<br/>Thomas: Let’s see … if we put the school name and address … here. They should be in capitals but there isn’t room for everything so big.<br/>Ruby: But people need to see the date and time clearly. I know … everybody knows the school address so that can be tiny.<br/>Thomas: Ok, Let’s try it that way.<br/>Ruby: I think it’s going to be really good poster.<br/>[pause]<br/>Now listen again.<br/>That is the end of Part 4<br/>'),
(38, 48, 'There are seven questions in this part. For each question there are three pictures and a short recording. For each question, choose the correct answer (A, B or C).', 'amthanhchl_1824608678.mp3', '', 'Nghe', 1, 0, 'There are seven questions in this part. For each question there are three pictures and a short recording. For each question, choose the correct answer (A, B or C).<br/>Before we start, here is an example.<br/>Where is the girl’s hat?<br/>Mum: where ‘s your new hat, Sally? I hope you haven’t left it on the school bus.<br/>Sally: Don’t worry, Mum. I put it in my school bag because I was too hot.<br/>Mum: Are you sure? I can’t see it there. You probably dropped it in the road somewhere.<br/>Sally: Oh, here it is – hanging in the hall. I forgot take it this morning.<br/>[pause]<br/>The answer is A.<br/>Look at the three pictures for question 1 now.<br/>[pause]<br/>Now we ready to start. Listen carefully. You will hear each recording twice.<br/>One. What can’t the woman find?<br/>Mum: I’m going to mend and paint the cupboard in your bedroom today. <br/>Daughter: Great, Mum. Anything I can do to help?<br/>Mum: Yes, can you go to the shop and get me a new hammer – this one’s broken. But before you do that, ask your dad what he’s done with the paintbrush – I’ve looked everywhere for it. There weren’t any in the garage; all I could find was this knife which I lost months ago.<br/>[pause]<br/>Now listen again.<br/>[The recording is repeated.]<br/>[pause]<br/>Two. What is the weather forecast for tomorrow?<br/>Man: And now for those of you planning to go to the rock festival tomorrow, you ‘ll want to know what the weather’s going to be like. As we go through today, the heavy rain will gradually disappear by the end of the afternoon. Tomorrow we can expect some sunshine with just a few light showers, and then some very hot and dry weather is likely by the weekend.<br/>[pause]<br/>Now listen again.<br/>[The recording is repeated.]<br/>[pause]<br/>Three: What did the boy buy?<br/>Son :I got most of the shopping you asked for, Mum.  I got the last of the bread and some orange juice but sorry, there weren’t any newspapers left.<br/>Mum: Oh, never mind, I need to remember to go in the morning. But what about the tomatoes for the salad?<br/>Son: Ah .. I forgot. I’ll go back for them.<br/>Mum: Oh, don’t worry, I’ll stop and pick some up when I go out to collect your sister.<br/> [pause]<br/>Now listen again.<br/>[pause]<br/>Four. Which present has the girl bought her mother?<br/>Jane: Hi … it’s me, Jane … I’ve got Mum’s birthday present. I think she ‘ll like it … Yes, that’s right, a gold-coloured one. She’s always writing letters, so she’ll find it useful … Mmm, I thought about a CD but I’m never really sure what music she likes, and Dad’s bought her a new pear of earrings for her birthday anyway. I’m sure she ‘ll like what I’ve got her.<br/>[pause]<br/>Now listen again.<br/>[pause]<br/>Five. Which TV programme will they watch together?<br/>Girl: Hasn’t that basketball match finished yet? You know I want to watch the wildlife programme at nine o’clock.<br/>Boy: It’s cancelled and everything’s running late because the rock concert finished later than expected. Sit down and watch this match with me. It’s really exciting, and more interesting than looking at animals.<br/>Girl: Oh, Ok then.<br/>[pause]<br/>Now listen again.<br/>[pause]<br/>Six. What time is the swimming lesson today?<br/>Girl: Hi Judy – do you want to play tennis after school – say about 4:30?<br/>Judy: Mmm – that would bate fun but I’ve got a swimming lesson. It’s usually at a quarter past five but It’s half an hour earlier this evening, at a quarter to five. It takes me ages to cycle to the swimming pool, so I really don’t think I’ll have time today – let’s try tomorrow.<br/>Girl: Ok<br/>[pause]<br/>Now listen again.<br/>[pause]<br/><br/>Seven. Which subject does the boy like best?<br/>Boy: I really like the new IT teacher – our project for this term is to design a new website. I’ve always wanted to know how to do that. The sports teacher is much more serous but that’s still my favourite subject. Last year I used to really like geography, but the teacher we have now gives us so much homework.<br/>[pause]<br/>Now listen again.<br/>[pause]<br/>'),
(39, 48, 'You will hear an interview with a teenager called Simon about going to an indoor climbing centre that has a climbing wall..<br/>For each question choose the correct answer A, B, or C.<br/>', 'amthanhchl_680280154.mp3', '', 'Nghe', 1, 0, '<br/>Now turn to Part 2, questions 8 to 13.<br/>You will hear an interview with a teenager called Simon about going to an indoor climbing centre that has a climbing wall..<br/>For each question choose the correct answer A, B, or C.<br/>You now have 45 seconds to look at the questions for Part2.<br/>[pause]<br/>Now we are ready to start. Listen carefully. You will hear the recording twice.<br/>Woman: Hello, everyone! Today we ‘re discussing adventure activities, and I’m talking to Simon Benito, who recently went with his mum to an indoor climbing centre. Simon, what gave your mum the idea to take you there?<br/>Simon: Well, last year my school had a trip to the c entre, but I missed it because I was sick. Then recently she went with a friend and tried it herself – and she loved it. So after that she wanted to take me, too.<br/>Woman: And what did you think when your mum suggested going to the centre?<br/>Simon: Well, I knew I was Ok at climbing – we ‘ve been climbing on holidays- and I thought we’d do something similar at the centre. Iwas really loking forward to it. But then my mum explained that the wall was inside. I wasn’t so interested when I heard that – I prefer being outside.<br/>Woman: But did you meet lots of people there?<br/>Simon: well, yes – that was great! It was early morning when we arrived and the centre had just opened, so it was quiet, but lots of people came later in the morning – and for once I wasn’t the youngest! I’d expected it ‘d be mainly young people there, but there were people of all ages –serious climbers, mums with five year olds … and teenagers like me!<br/>Woman: So what was the climbing wall like?<br/>Simon: Well, luckily it had rocks of different sizes to help you climb. So there was little chance of falling off. And I’d imagined it would look high before you started to climb, but actually it didn’t seem that far to the top. There were lots of really useful holes all over it too, to put your feet in – green ones for an easy climb, red for more difficult.<br/>Woman: Show what was your first climb like? Was it easy?<br/>Simon: No, the instructor showed us what to do and I thought I’d soon get to the top, but I was the last to get there, so I was annoyed with myself. The instructor warned us it can be painful for your arms, too, but I didn’t notice. And I did improve.<br/>Woman: So what did you learn from your visit?<br/>Simon: Well, it was great to be with other people who all like doing the same thing! And when I was climbing I had to think carefully where to put my feet before I moved – so that’s helped me to think first before I do things. It’s shown me that I am fitter than my friends who spend too much time on their computers<br/>Woman: Well, thanks, Simon!<br/> [pause]<br/>Now listen again.<br/>That is the end of Part 2.<br/>'),
(40, 48, 'Look at the six sentences for this part.<br/>You will hear a  conversation between a boy called Jamied and a girl called Miranda about sharing a bedroom with a brother or sister. Decide if each sentence is correct or incorrect.<br/>If it is correct, choose the letter A for YES. If it is not correct choose the letter B for NO.', 'amthanhchl_1734422214.mp3', '', 'Nghe', 1, 0, 'Now turn to Part 4, question 20 to 25<br/>Look at the six sentences for this part<br/>You will hear a conversation between a boy called Jamie and a girl called Miranda about sharing a bedroom with a brother or sister.<br/>Decide if each sentence is correct or incorrect. If it is correct, choose the letter A for YES. If it is not correct, choose the letter B for NO.<br/>[pause]<br/>Now we are ready to start. Listen carefully. You will hear the recording twice.<br/>Jamie: Hi, Miranda, How are you?<br/>Miranda: Hi, Jamie. I’m fine! I’m helping Mum paint my bedroom at home – the one I share with my younger sister.<br/>Jamie: Oh, how’s it going?<br/>Miranda: Not well – we can’t agree! My sister and I both have got our own side of the room, and they ‘re completely different! I mean, my side’s blue, with pop posters all over the wall. But her side’s pink, with dolls and stuff. Not my thing at all really, but as I said, she is younger than me – and it looks Ok, I guess.<br/>Jamie: Mmm – well, I share with my brother Max, but as he’s older than me, I get to use lots of things that my parents don’t really want me to have, because they say I’m not old enough. But he lets me use his laptop, music player .. everything!<br/>Mirranda: Wow! Now, if that was my little sister, she’d probably go and report it to our mum and I’d get into trouble! That happens sometimes. Then my sister and I have an argument!<br/>Jamie: Oh? That doesn’t happen with Max and me …<br/>Mirranda: No? Well apart from that, I get on Ok with my sister, really. To be honest, she went camping with her school last week, and I really missed her. I found it wasn’t so nice being in our room on my own. I hadn’t expected that.<br/>Jamie: I know, what you mean. My brother’s going to university soon, and the room will seem really empty. Still, at least I’ll be able to get on with my homework in peace – it’s hard at the moment, as he’s often in the room, too.<br/>Miranda: Well, my sister likes playing outside, so It’s OK. But then when she’s not there, there’s no one to talk to about my problems. She’s really good at listening if she knows I’m worried about something, even though she can’t help.<br/>Jamie: Mmm, my brother’s the same. We wouldn’t do that if we didn’t share rooms.<br/>Miranda: No… so sharing does have good points …<br/> [pause]<br/>Now listen again.<br/>That is the end of Part 4<br/>'),
