(1314, 164, ' ', 'amthanhchl_634161423.mp3', '', 'Nghe', 1, 0, 'What color is the schoolbag? It is blue.'),
(1315, 164, ' ', 'amthanhchl_845932835.mp3', '', 'Nghe', 1, 0, 'My daughter has a blackboard in her bedroom.'),
(1316, 164, ' ', 'amthanhchl_221047642.mp3', '', 'Nghe', 1, 0, 'Have you read any good books recently?'),
(1317, 164, ' ', 'amthanhchl_1520631462.mp3', '', 'Nghe', 1, 0, 'He picked up a piece of chalk.  and , wrote the answer on the blackboard.'),
(1318, 164, ' ', 'amthanhchl_418581753.mp3', '', 'Nghe', 1, 0, 'I don\'t think another desk will fit into the classroom.'),
(1319, 164, ' ', 'amthanhchl_1102999797.mp3', '', 'Nghe', 1, 0, 'If you draw or write in pencil, you can always rub out your mistakes with an eraser.'),
(1320, 164, ' ', 'amthanhchl_235262488.mp3', '', 'Nghe', 1, 0, 'The kids are busy with their homework.'),
(1321, 164, ' ', 'amthanhchl_395076303.mp3', '', 'Nghe', 1, 0, 'I carry a notebook so that I can jot down any ideas.'),
(1322, 164, ' ', 'amthanhchl_1710123407.mp3', '', 'Nghe', 1, 0, 'My pen seems to be running out of ink. I need a refill.'),
(1323, 164, ' ', 'amthanhchl_1438165595.mp3', '', 'Nghe', 1, 0, 'It\'s in pencil, so you can rub it out if you need to.'),
(1324, 164, ' ', 'amthanhchl_351085878.mp3', '', 'Nghe', 1, 0, 'The school has over 400 pupils.'),
