(1364, 171, 'Phép trừ trên đúng hay sai', 'amthanhchl_1946266776.mp3', 'hchl__1711389357928.png', 'Nghe', 1, 0, 'Phép trừ trên đúng hay sai'),
(1365, 169, ' ', 'amthanhchl_1043260433.mp3', '', 'Nghe', 1, 0, 'We love to watch the Olympics - especially the athletics.'),
(1366, 169, ' ', 'amthanhchl_598596906.mp3', '', 'Nghe', 1, 0, 'The two people playing badminton, seemed to be at it quite intensely.'),
(1367, 169, ' ', 'amthanhchl_635424713.mp3', '', 'Nghe', 1, 0, 'Do you play any other sports besides football and basketball?'),
(1368, 169, ' ', 'amthanhchl_1856251662.mp3', '', 'Nghe', 1, 0, 'Can you dance the tango?'),
(1369, 169, ' ', 'amthanhchl_1680747873.mp3', '', 'Nghe', 1, 0, 'My father took me to watch the football every Saturday.'),
(1370, 169, ' ', 'amthanhchl_45124409.mp3', '', 'Nghe', 1, 0, 'Let\'s go skiing.'),
(1371, 169, ' ', 'amthanhchl_566183060.mp3', '', 'Nghe', 1, 0, 'They go surfing every weekend.'),
(1372, 169, ' ', 'amthanhchl_1238788117.mp3', '', 'Nghe', 1, 0, 'He used to swim for his country when he was younger.'),
(1373, 169, ' ', 'amthanhchl_1221871210.mp3', '', 'Nghe', 1, 0, 'Elbow injuries are commonly found among tennis players.'),
(1374, 169, ' ', 'amthanhchl_891198543.mp3', '', 'Nghe', 1, 0, 'She\'s upset she didn\'t make the volleyball team.'),
