(1417, 174, ' ', 'amthanhchl_1218631357.mp3', '', 'Nghe', 1, 0, 'They built the church on the edge of the village.'),
(1418, 174, ' ', 'amthanhchl_342303213.mp3', '', 'Nghe', 1, 0, 'Our farm straddles the railway line.'),
(1419, 174, ' ', 'amthanhchl_998339503.mp3', '', 'Nghe', 1, 0, 'The house was surrounded by a tall, wooden fence.'),
(1420, 174, ' ', 'amthanhchl_2069134194.mp3', '', 'Nghe', 1, 0, 'She threw the cheese in the garbage.'),
(1421, 174, ' ', 'amthanhchl_168669215.mp3', '', 'Nghe', 1, 0, 'Keeping a garden tidy is a full-time job.'),
(1422, 174, ' ', 'amthanhchl_984130204.mp3', '', 'Nghe', 1, 0, 'She spent a week in the hospital last year.'),
(1423, 174, ' ', 'amthanhchl_490451028.mp3', '', 'Nghe', 1, 0, 'I\'m worried about leaving him alone in the house all day.'),
(1424, 174, ' ', 'amthanhchl_963444184.mp3', '', 'Nghe', 1, 0, 'Car exhaust is the main reason for the city\'s pollution.'),
(1425, 174, ' ', 'amthanhchl_575175746.mp3', '', 'Nghe', 1, 0, 'She collects her pension from the post office.'),
(1426, 174, ' ', 'amthanhchl_1267574138.mp3', '', 'Nghe', 1, 0, 'She drives the kids to school every morning.'),
