(1817, 217, 'Năm ngoái nông trại Vui Học sản xuất được 1329 quả trứng. Năm nay nông trai sản xuất được 6722 quả trứng. Hỏi có bao nhiêu quả trứng được sản xuất thêm trong năm nay?', '', 'hchl__2172070012063.png', 'toan', 1, 0, ''),
(1818, 217, 'Một cửa hàng bánh kẹo đã bán được tổng cộng 8181 cái bánh trong tuần trước. Trong đó có 4111 bánh là bánh sô cô la. Hỏi số lượng bánh khác là bao nhiêu?', '', 'hchl__2171650396684.png', 'toan', 1, 0, ''),
(1819, 217, 'Có một sự cố tràn dầu trong một rạn san hô. Kết quả là, công ty dầu mỏ đã tiêu tốn tổng cộng $ 8,804 trong việc dọn dẹp và sửa chữa. Chỉ riêng việc sửa chữa có giá $ 5,223. Hỏi chi phí để làm sạch số dầu là bao nhiêu?', '', 'hchl__217927950848.png', 'toan', 1, 0, ''),
(1820, 217, 'Một đĩa petri ban đầu chứa 576 vi khuẩn. Một nhà khoa học đã để vi khuẩn phát triển và hiện có 8.679 con.Hỏi có thêm bao nhiêu con vi khuẩn nữa?', '', 'hchl__2171552696466.png', 'toan', 1, 0, ''),
(1821, 217, 'Bệnh viện Dayton đã điều trị cho 4.357 bệnh nhân là trẻ em trong tổng số 8,005 bệnh nhân vào năm ngoái. Hỏi có bao nhiêu bệnh nhân là người lớn?', '', 'hchl__217678380114.png', 'toan', 1, 0, ''),
(1822, 217, 'Một cửa hàng nọ phục vụ 1855 khách hàng, trong đó có 342 là người lớn. Hỏi có bao nhiêu khách hàng là trẻ em.', '', 'hchl__2171895701213.png', 'toan', 1, 0, ''),
(1823, 217, 'Trong khi chơi một trò chơi video, Bình ghi được 9,911 điểm. Anh và anh em họ của mình có tổng cộng 63.822 điểm. Hỏi anh em họ của Bình có bao nhiêu điểm?', '', 'hchl__217415061234.png', 'toan', 1, 0, ''),
(1824, 217, 'Vào tháng 11, một công ty xúc xích đã bán tổng cộng 8.896 xúc xích  trên toàn thế giới. Trong số này, họ đã bán được 6.606 ở Hoa Kỳ. Hỏi họ đã bán bao nhiêu cái ở các nước khác?', '', 'hchl__217136511933.png', 'toan', 1, 0, ''),
(1825, 217, 'Một ống dầu trên biển bị vỡ. Trước khi các kỹ sư bắt đầu sửa đường ống, 13.789 lít dầu đã rò rỉ vào nước. Tổng cộng có 68.990 lít dầu bị rò rỉ trước khi đường ống được sửa chữa.Hỏi có bao nhiêu lít dầu bị rò rỉ trong khi các kỹ sư đang sửa chữa đường ống?', '', 'hchl__217998262625.png', 'toan', 1, 0, ''),
(1826, 217, 'Một sự cố tràn dầu trên bờ biển và bao phủ tổng cộng 6.895 con chim bằng dầu. Cho đến nay, một nhóm tình nguyện viên đã làm sạch 180 con chim. Các tình nguyện viên cần làm sạch thêm bao nhiêu con chim?', '', 'hchl__2171852529902.png', 'toan', 1, 0, ''),
(1827, 217, 'Một cửa hàng có đơn đặt hàng 62088 cái. Họ đang có sẳn 5403 cái. Hỏi phải làm thêm bao nhiêu cái nữa?', '', 'hchl__2172133281714.png', 'toan', 1, 0, ''),
