(2986, 296, 'Tuần trước, nhà ăn của trường đã bán 1 bánh mì thịt bò nướng, 5 bánh mì kẹp trứng và 5 bánh mì gà. Có bao nhiêu bánh mì họ đã bán tất cả?', '', '', 'toan', 1, 0, 'Tuần trước, nhà ăn của trường đã bán 1 bánh mì thịt bò nướng, 5 bánh mì kẹp trứng và 5 bánh mì gà. Có bao nhiêu bánh mì họ đã bán tất cả?'),
(2987, 296, 'Trong tủ khóa thiết bị cho lớp thể dục có 5 quả bóng rổ, 2 quả bóng đá và 5 quả bóng chuyền. Có bao nhiêu quả bóng trong tủ khóa thiết bị?', '', '', 'toan', 1, 0, 'Trong tủ khóa thiết bị cho lớp thể dục có 5 quả bóng rổ, 2 quả bóng đá và 5 quả bóng chuyền. Có bao nhiêu quả bóng trong tủ khóa thiết bị?'),
(2988, 296, 'Hôm qua, Hải đã đến trung tâm thương mại và chi 3 đồng cho áo phông, 5 đồng cho một đôi vớ và 5 đồng cho một đôi găng tay. Hải đã chi bao nhiêu tiền?', '', '', 'toan', 1, 0, 'Hôm qua, Hải đã đến trung tâm thương mại và chi 3 đồng cho áo phông, 5 đồng cho một đôi vớ và 5 đồng cho một đôi găng tay. Hải đã chi bao nhiêu tiền?'),
(2989, 296, 'Người bán hoa đã làm một bó hoa với 5 bông hồng đỏ, 5 bông hoa cúc vàng và 4 bông hoa tulip màu hồng. Có bao nhiêu bông hoa đã đặt trong bó hoa?', '', '', 'toan', 1, 0, 'Người bán hoa đã làm một bó hoa với 5 bông hồng đỏ, 5 bông hoa cúc vàng và 4 bông hoa tulip màu hồng. Có bao nhiêu bông hoa đã đặt trong bó hoa?');
INSERT INTO `hv_cauhoilon` (`id`, `id_bai`, `noidung`, `amthanh`, `hinhanh`, `loai`, `congkhai`, `xoa`, `hotro`) VALUES
(2990, 296, 'Trong một vườn cây có 5 cây nhã, 5 cây vải và 5 cây lịu. Có bao nhiêu cây trong vườn?', '', '', 'toan', 1, 0, 'Trong một vườn cây có 5 cây nhã, 5 cây vải và 5 cây lịu. Có bao nhiêu cây trong vườn?'),
(2991, 296, 'Hôm qua, một cửa hàng bánh đã bán 5 chiếc bánh táo, 1 chiếc bánh bông lan và 5 chiếc bánh mì. Có bao nhiêu chiếc bánh đã bán tất cả?', '', '', 'toan', 1, 0, 'Hôm qua, một cửa hàng bánh đã bán 5 chiếc bánh táo, 1 chiếc bánh bông lan và 5 chiếc bánh mì. Có bao nhiêu chiếc bánh đã bán tất cả?'),
(2992, 296, 'Cửa hàng đồng hồ trên phố có 5 đồng hồ bằng gỗ, 3 đồng hồ kim loại và 5 đồng hồ thủy tinh. Cửa hàng có bao nhiêu đồng hồ?', '', '', 'toan', 1, 0, 'Cửa hàng đồng hồ trên phố có 5 đồng hồ bằng gỗ, 3 đồng hồ kim loại và 5 đồng hồ thủy tinh. Cửa hàng có bao nhiêu đồng hồ?'),
(2993, 296, 'Hiếu mua một túi kẹo và sắp xếp chúng theo màu. Cô có 5 viên kẹo đỏ, 4 viên kẹo màu cam và 5 viên kẹo màu vàng. Có bao nhiêu kẹo trong túi?', '', '', 'toan', 1, 0, 'Hiếu mua một túi kẹo và sắp xếp chúng theo màu. Cô có 5 viên kẹo đỏ, 4 viên kẹo màu cam và 5 viên kẹo màu vàng. Có bao nhiêu kẹo trong túi?'),
(2994, 296, 'Ly đang tập luyện cho một cuộc đua xe đạp. Tuần trước, cô đã đạp xe 5 km vào thứ Hai, 5 km vào thứ Ba và 3 km vào thứ Tư. Cô ấy đạp xe bao nhiêu km?', '', '', 'toan', 1, 0, 'Ly đang tập luyện cho một cuộc đua xe đạp. Tuần trước, cô đã đạp xe 5 km vào thứ Hai, 5 km vào thứ Ba và 3 km vào thứ Tư. Cô ấy đạp xe bao nhiêu km?'),
(2995, 296, 'Maki thu thập lá trong công viên. Cô đã thu thập 5 lá vàng, 5 lá xanh và 1 lá đỏ. Maki đã thu thập được bao nhiêu lá?', '', '', 'toan', 1, 0, 'Maki thu thập lá trong công viên. Cô đã thu thập 5 lá vàng, 5 lá xanh và 1 lá đỏ. Maki đã thu thập được bao nhiêu lá?'),
(2996, 296, 'Mai mua một túi kẹo và sắp xếp chúng theo hương vị. Cô có 9 kẹo mút anh đào, 9 kẹo mút nho và 1 kẹo mút chanh. Có bao nhiêu kẹo mút trong túi?', '', '', 'toan', 1, 0, 'Mai mua một túi kẹo và sắp xếp chúng theo hương vị. Cô có 9 kẹo mút anh đào, 9 kẹo mút nho và 1 kẹo mút chanh. Có bao nhiêu kẹo mút trong túi?'),
(2997, 296, 'Isaac đã đến cửa hàng tạp hóa và chi 5 đô la cho trứng, 3 đô la cho sữa và 5 đô la cho ngũ cốc. Isaac đã tiêu bao nhiêu tiền?', '', '', 'toan', 1, 0, 'Isaac đã đến cửa hàng tạp hóa và chi 5 đô la cho trứng, 3 đô la cho sữa và 5 đô la cho ngũ cốc. Isaac đã tiêu bao nhiêu tiền?'),
(2998, 296, 'Ronald quyết định bán một số thứ cũ để quyên góp tiền từ thiện. Ông đã bán một chiếc xe đạp cũ với giá 5 đô la, một đôi ván trượt với giá 5 đô la và một chiếc ghế dài với giá 5 đô la. Ronald đã kiếm được bao nhiêu tiền?', '', '', 'toan', 1, 1, 'Ronald quyết định bán một số thứ cũ để quyên góp tiền từ thiện. Ông đã bán một chiếc xe đạp cũ với giá 5 đô la, một đôi ván trượt với giá 5 đô la và một chiếc ghế dài với giá 5 đô la. Ronald đã kiếm được bao nhiêu tiền?'),
(2999, 296, 'Một giỏ trái cây chứa 5 quả táo, 4 quả cam và 5 quả chuối. Có bao nhiêu trái cây trong giỏ trái cây?', '', '', 'toan', 1, 0, 'Một giỏ trái cây chứa 5 quả táo, 4 quả cam và 5 quả chuối. Có bao nhiêu trái cây trong giỏ trái cây?'),
(3000, 296, 'Shontal và cha mẹ cô đã đi du lịch bụi. Họ đã đi bộ 5 km vào thứ Hai, 5 km vào thứ Ba và 7 km vào thứ Tư. Họ đã đi bộ bao nhiêu km?', '', '', 'toan', 1, 0, 'Shontal và cha mẹ cô đã đi du lịch bụi. Họ đã đi bộ 5 km vào thứ Hai, 5 km vào thứ Ba và 7 km vào thứ Tư. Họ đã đi bộ bao nhiêu km?'),
(3001, 296, 'Vào thứ hai, Eric bắt đầu đọc một chương mới và hoàn thành 1 trang. Vào thứ ba, ông đọc 5 trang, và vào thứ tư, ông đọc 5 trang và hoàn thành chương này. Chương này dài bao nhiêu trang?', '', '', 'toan', 1, 0, 'Vào thứ hai, Eric bắt đầu đọc một chương mới và hoàn thành 1 trang. Vào thứ ba, ông đọc 5 trang, và vào thứ tư, ông đọc 5 trang và hoàn thành chương này. Chương này dài bao nhiêu trang?'),
(3002, 296, 'Warren đã quyên góp tiền cho các chương trình khác nhau vào năm ngoái. Đầu tiên, anh quyên góp 8 đô la cho trung tâm cộng đồng và 2 đô la để cứu những động vật đang bị đe dọa. Sau đó, ông đã quyên góp 2 đô la cho y tế. Warren đã quyên góp bao nhiêu tiền?', '', '', 'toan', 1, 1, 'Warren đã quyên góp tiền cho các chương trình khác nhau vào năm ngoái. Đầu tiên, anh quyên góp 8 đô la cho trung tâm cộng đồng và 2 đô la để cứu những động vật đang bị đe dọa. Sau đó, ông đã quyên góp 2 đô la cho y tế. Warren đã quyên góp bao nhiêu tiền?'),
(3003, 296, 'Tuần trước, nhà ăn của trường đã bán 1 bánh mì thịt bò nướng, 9 bánh mì kẹp trứng và 1 bánh xôi gà. Có bao nhiêu bánh họ đã bán tất cả?', '', '', 'toan', 1, 0, 'Tuần trước, nhà ăn của trường đã bán 1 bánh mì thịt bò nướng, 9 bánh mì kẹp trứng và 1 bánh xôi gà. Có bao nhiêu bánh họ đã bán tất cả?'),
(3004, 296, 'Mai đang vui chơi. Bạn đang thu thập 2 lá đỏ, 8 lá cam và 8 lá vàng. Mai thu thập được bao nhiêu lá?', '', '', 'toan', 1, 0, 'Mai đang vui chơi. Bạn đang thu thập 2 lá đỏ, 8 lá cam và 8 lá vàng. Mai thu thập được bao nhiêu lá?'),
(3005, 296, 'Brandy đã quyên góp tiền cho các chương trình khác nhau vào năm ngoái. Đầu tiên, cô đã quyên góp 5 đô la cho trung tâm cộng đồng và 6 đô la để cứu những động vật đang bị đe dọa. Sau đó, cô đã quyên góp 5 đô la cho y tế. Brandy đã quyên góp bao nhiêu tiền?', '', '', 'toan', 1, 1, 'Brandy đã quyên góp tiền cho các chương trình khác nhau vào năm ngoái. Đầu tiên, cô đã quyên góp 5 đô la cho trung tâm cộng đồng và 6 đô la để cứu những động vật đang bị đe dọa. Sau đó, cô đã quyên góp 5 đô la cho y tế. Brandy đã quyên góp bao nhiêu tiền?'),
(3006, 296, 'Tháng trước, một đại lý ô tô đã bán 7 xe bán tải, 3 xe tải và 7 toa xe. Có bao nhiêu xe đã bán ở đại lý?', '', '', 'toan', 1, 0, 'Tháng trước, một đại lý ô tô đã bán 7 xe bán tải, 3 xe tải và 7 toa xe. Có bao nhiêu xe đã bán ở đại lý?'),
(3007, 296, 'Một tiệm bánh đã bán 3 lát bánh sô cô la, 7 lát bánh vani và 3 lát bánh cà rốt. Có bao nhiêu lát bánh mà tiệm bánh đã bán hết?', '', '', 'toan', 1, 0, 'Một tiệm bánh đã bán 3 lát bánh sô cô la, 7 lát bánh vani và 3 lát bánh cà rốt. Có bao nhiêu lát bánh mà tiệm bánh đã bán hết?'),
(3008, 296, 'Một nhà hàng ăn sáng đã bán 6 đơn hàng trứng chiên, 4 đơn hàng trứng luộc và 6 đơn hàng trứng chiên. Nhà hàng đã bán bao nhiêu đơn hàng trứng?', '', '', 'toan', 1, 0, 'Một nhà hàng ăn sáng đã bán 6 đơn hàng trứng chiên, 4 đơn hàng trứng luộc và 6 đơn hàng trứng chiên. Nhà hàng đã bán bao nhiêu đơn hàng trứng?'),
