(3081, 27, 'Mary goes to the store. The store is very big. The store sells bakery goods. Mary sees a carrot cake. She does not like carrots. She sees a banana nut muffin. It looks good. It costs two dollars. She buys it. She takes the wrapper off. She takes a big bite. It is crunchy on the outside. It is soft on the inside.', 'amthanhchl_1082470863.mp3', '', 'Nghe', 1, 0, 'Mary goes to the store. The store is very big. The store sells bakery goods. Mary sees a carrot cake. She does not like carrots. She sees a banana nut muffin. It looks good. It costs two dollars. She buys it. She takes the wrapper off. She takes a big bite. It is crunchy on the outside. It is soft on the inside.'),
(3082, 25, 'Linda loves the park. There is so much to do. First, she looks at the sky. One cloud looks like a dog. Another cloud looks like a sheep. Later, she feeds the ducks. They are hungry. Linda throws bread crumbs. The ducks enjoy the food. Finally, Linda watches the sun go down. It is beautiful.', 'amthanhchl_1832575066.mp3', '', 'Nghe', 1, 0, 'Linda loves the park. There is so much to do. First, she looks at the sky. One cloud looks like a dog. Another cloud looks like a sheep. Later, she feeds the ducks. They are hungry. Linda throws bread crumbs. The ducks enjoy the food. Finally, Linda watches the sun go down. It is beautiful.'),
(3083, 38, 'He woke up. He got out of bed. He went to the restroom and took a shower. The water was cold at first. He made it warm. He took ten minutes to shower. He stepped out of the shower. The floor became wet. He grabbed a towel. He wrapped it all around him. He went to his bathroom mirror. He saw his reflection. He looked handsome. He had grown facial hair. It was time for him to shave it. He grabbed the shaving cream and poured some in his hand. He spread the shaving cream around his face. He grabbed the razor and started shaving. He cut himself by accident. It started bleeding. He was not hurt. He washed his face and applied aftershave. He put a band-aid on his cut. The cut stung him a little. He dried himself, and started getting ready for work.', 'amthanhchl_263494830.mp3', '', 'Nghe', 1, 0, 'He woke up. He got out of bed. He went to the restroom and took a shower. The water was cold at first. He made it warm. He took ten minutes to shower. He stepped out of the shower. The floor became wet. He grabbed a towel. He wrapped it all around him. He went to his bathroom mirror. He saw his reflection. He looked handsome. He had grown facial hair. It was time for him to shave it. He grabbed the shaving cream and poured some in his hand. He spread the shaving cream around his face. He grabbed the razor and started shaving. He cut himself by accident. It started bleeding. He was not hurt. He washed his face and applied aftershave. He put a band-aid on his cut. The cut stung him a little. He dried himself, and started getting ready for work.'),
(3084, 47, 'She came back home from work. She looked at the clock and yawned. It was nine o\'clock. She went to her bedroom and put on her pajamas. She got her blanket. She lay down on her bed. The room was cold. She got up and went to her closet to get extra blankets. She lay down again and covered herself. She fell asleep. She woke up in the middle of the night to get a glass of water. She drank the glass of water. She walked back to her bedroom. She yawned and fell asleep. Two hours passed. She woke up and went to the restroom. She heard a noise outside her window. She looked out the window to see what it was. It was a black cat climbing a tree. She hushed the cat. The cat ran away. She went back to bed. She closed her eyes and fell asleep. She slept very little.', 'amthanhchl_2145913268.mp3', '', 'Nghe', 1, 0, 'She came back home from work. She looked at the clock and yawned. It was nine o\'clock. She went to her bedroom and put on her pajamas. She got her blanket. She lay down on her bed. The room was cold. She got up and went to her closet to get extra blankets. She lay down again and covered herself. She fell asleep. She woke up in the middle of the night to get a glass of water. She drank the glass of water. She walked back to her bedroom. She yawned and fell asleep. Two hours passed. She woke up and went to the restroom. She heard a noise outside her window. She looked out the window to see what it was. It was a black cat climbing a tree. She hushed the cat. The cat ran away. She went back to bed. She closed her eyes and fell asleep. She slept very little.'),
(3085, 39, 'It was night time. He went out to walk his dog. His dog was big. The dog\'s name was Max. \"Let\'s go, Max!\" he said to his dog. He walked past his neighbor\'s house. He saw there were no lights in the house. His neighbor was not home. He walked past the market. There were people shopping for groceries. He remembered he needed milk. He tied Max to a pole. \"Wait here, Max,\" he said. He walked inside the market. It took fifteen minutes to buy the milk. He untied Max and continued walking. He walked back to his house. He let Max inside the house. It was time to feed Max. He served Max a bowl of dog food. Max ate it quickly. It was late. He took Max to the backyard. Max slept in a dog house. He said good night to Max. Max barked.', 'amthanhchl_1652426053.mp3', '', 'Nghe', 1, 0, 'It was night time. He went out to walk his dog. His dog was big. The dog\'s name was Max. \"Let\'s go, Max!\" he said to his dog. He walked past his neighbor\'s house. He saw there were no lights in the house. His neighbor was not home. He walked past the market. There were people shopping for groceries. He remembered he needed milk. He tied Max to a pole. \"Wait here, Max,\" he said. He walked inside the market. It took fifteen minutes to buy the milk. He untied Max and continued walking. He walked back to his house. He let Max inside the house. It was time to feed Max. He served Max a bowl of dog food. Max ate it quickly. It was late. He took Max to the backyard. Max slept in a dog house. He said good night to Max. Max barked.'),
(3086, 50, 'It was a hot day. The sun was shining in the sky. The air was sticky. It was a Sunday afternoon. Jane was thirsty. She went to the kitchen to get a drink. She opened her refrigerator. There was nothing to drink inside. Jane grabbed some lemons and a big pitcher. She cut the lemons in two. She filled the large pitcher with water. She squeezed the lemons into the pitcher of water. She opened her cabinet to get the sugar. She poured some sugar into the pitcher of water and lemon juice. She had made lemonade. She took a sip of the lemonade. It needed more sugar. She grabbed the bag of sugar and poured a little more. She took another sip. The lemonade tasted sweet. All it needed now was ice. She opened the refrigerator to grab some ice. There was no ice.', 'amthanhchl_1103936714.mp3', '', 'Nghe', 1, 0, 'It was a hot day. The sun was shining in the sky. The air was sticky. It was a Sunday afternoon. Jane was thirsty. She went to the kitchen to get a drink. She opened her refrigerator. There was nothing to drink inside. Jane grabbed some lemons and a big pitcher. She cut the lemons in two. She filled the large pitcher with water. She squeezed the lemons into the pitcher of water. She opened her cabinet to get the sugar. She poured some sugar into the pitcher of water and lemon juice. She had made lemonade. She took a sip of the lemonade. It needed more sugar. She grabbed the bag of sugar and poured a little more. She took another sip. The lemonade tasted sweet. All it needed now was ice. She opened the refrigerator to grab some ice. There was no ice.'),
(3087, 43, 'It was a cold night. The moon was bright and round. The wind blew cold through the window. Jim got up from his couch and closed it. Jim was shivering because it was cold. He rubbed his hands together. Jim went to the kitchen. He wanted to make coffee. He opened his cabinet. He grabbed the can of coffee beans. He opened the lid. He held the can up to his nose. He took a deep breath. It smelled like fresh coffee beans. Jim loved the smell of coffee. He loved drinking coffee more. He poured the beans into the coffee maker. He grabbed a pitcher and put it in under the machine. He pressed a button and it started brewing. Jim started shivering again. He moved around to warm his body. The machine took fifteen minutes to finish. Jim poured the coffee into a mug. He drank it all. The coffee warmed his body. He stopped shivering.', 'amthanhchl_1671742294.mp3', '', 'Nghe', 1, 0, 'It was a cold night. The moon was bright and round. The wind blew cold through the window. Jim got up from his couch and closed it. Jim was shivering because it was cold. He rubbed his hands together. Jim went to the kitchen. He wanted to make coffee. He opened his cabinet. He grabbed the can of coffee beans. He opened the lid. He held the can up to his nose. He took a deep breath. It smelled like fresh coffee beans. Jim loved the smell of coffee. He loved drinking coffee more. He poured the beans into the coffee maker. He grabbed a pitcher and put it in under the machine. He pressed a button and it started brewing. Jim started shivering again. He moved around to warm his body. The machine took fifteen minutes to finish. Jim poured the coffee into a mug. He drank it all. The coffee warmed his body. He stopped shivering.'),
(3088, 51, 'It was a cloudy day. It looked like it was going to rain. Jim put on his raincoat and rain boots. He grabbed his umbrella and left his house. He had to walk to an elementary school to pick up his sister. It was three o\'clock. Jim\'s little sister was coming out of school. He walked along the streets. He looked at his clothes. His rain boots were black. His raincoat was green. His jeans were blue. His umbrella was red. Jim looked around as he walked. People were dressed similarly. The clouds looked dark. They were heavy with rain. Jim walked faster. Jim arrived at 3:20. The school bell would ring at 3:30. Jim needed to wait ten more minutes. He was at the front gate. There were parents waiting alongside with Jim. The school bell rang. Children were escorted to the front gate. Jim\'s sister ran up to him. They hugged, and walked home together.', 'amthanhchl_400649753.mp3', '', 'Nghe', 1, 0, 'It was a cloudy day. It looked like it was going to rain. Jim put on his raincoat and rain boots. He grabbed his umbrella and left his house. He had to walk to an elementary school to pick up his sister. It was three o\'clock. Jim\'s little sister was coming out of school. He walked along the streets. He looked at his clothes. His rain boots were black. His raincoat was green. His jeans were blue. His umbrella was red. Jim looked around as he walked. People were dressed similarly. The clouds looked dark. They were heavy with rain. Jim walked faster. Jim arrived at 3:20. The school bell would ring at 3:30. Jim needed to wait ten more minutes. He was at the front gate. There were parents waiting alongside with Jim. The school bell rang. Children were escorted to the front gate. Jim\'s sister ran up to him. They hugged, and walked home together.'),
(3089, 46, 'Jim and his sister were walking home from school. \"How was school?\" Jim asked. \"It was nice,\" said Jim\'s sister. Her name was Nancy. Nancy was seven. She had black hair. Her hair was short and straight. She also had braces. Jim forgot to bring an umbrella for Nancy. Jim and Nancy huddled together under Jim\'s umbrella. The rain fell lightly. \"Let\'s hurry,\" Jim said. Jim and Nancy walked faster. Jim stepped on a puddle. The water splashed. Nancy\'s pants got wet. \"I\'m sorry,\" Jim said. \"It\'s okay,\" said Nancy. It started raining more. They soon arrived home. Lightning struck across the sky. It sounded loud. They were safe inside. Nancy\'s clothes were wet. She changed her clothes. Jim did the same. Nancy looked out the window. It was raining hard. She was glad to be inside. Jim felt the same.', 'amthanhchl_2131272770.mp3', '', 'Nghe', 1, 0, 'Jim and his sister were walking home from school. \"How was school?\" Jim asked. \"It was nice,\" said Jim\'s sister. Her name was Nancy. Nancy was seven. She had black hair. Her hair was short and straight. She also had braces. Jim forgot to bring an umbrella for Nancy. Jim and Nancy huddled together under Jim\'s umbrella. The rain fell lightly. \"Let\'s hurry,\" Jim said. Jim and Nancy walked faster. Jim stepped on a puddle. The water splashed. Nancy\'s pants got wet. \"I\'m sorry,\" Jim said. \"It\'s okay,\" said Nancy. It started raining more. They soon arrived home. Lightning struck across the sky. It sounded loud. They were safe inside. Nancy\'s clothes were wet. She changed her clothes. Jim did the same. Nancy looked out the window. It was raining hard. She was glad to be inside. Jim felt the same.'),
(3090, 52, 'His stomach was growling. He had not eaten in five hours. He was starving. He went to his kitchen. He took out a loaf of bread. The bread was made from wheat. It was his favorite bread to eat. He grabbed two slices. He opened the fridge. He gathered all the ingredients. He laid them out across the table. He opened the jar of mayonnaise. It was low-fat mayonnaise. He spread it across the slice of bread. He used a knife to spread the mayonnaise. He unzipped the container of ham. The ham was honey glazed. He grabbed four slices of ham. He put it on the bread slice. He opened the cheese container. He grabbed a slice and put it on top of the ham. He cut some tomatoes and lettuce. He put the vegetables on top of the cheese and ham. He glazed it all with ketchup and mustard. The sandwich was ready for him to eat.', 'amthanhchl_1609223414.mp3', '', 'Nghe', 1, 0, 'His stomach was growling. He had not eaten in five hours. He was starving. He went to his kitchen. He took out a loaf of bread. The bread was made from wheat. It was his favorite bread to eat. He grabbed two slices. He opened the fridge. He gathered all the ingredients. He laid them out across the table. He opened the jar of mayonnaise. It was low-fat mayonnaise. He spread it across the slice of bread. He used a knife to spread the mayonnaise. He unzipped the container of ham. The ham was honey glazed. He grabbed four slices of ham. He put it on the bread slice. He opened the cheese container. He grabbed a slice and put it on top of the ham. He cut some tomatoes and lettuce. He put the vegetables on top of the cheese and ham. He glazed it all with ketchup and mustard. The sandwich was ready for him to eat.'),
(3091, 53, 'She woke up one morning and felt hungry. She did not eat anything last night. She got out of bed, and walked into her kitchen. The kitchen was clean. She thought about what to eat for breakfast. She opened her refrigerator and took out a carton of eggs. She opened her cabinet, and reached for a bowl. She cracked four eggs into the bowl. She stirred the eggs with a spoon. She turned on the stove, and placed a pan on the stove. She turned the knob on the stove. The fire was lit. She grabbed a stick of butter from the fridge. She tossed the butter on the hot pan. She grabbed the bowl of eggs and threw them on the pan. She scrambled them with a spatula. The eggs cooked in minutes. They smelled delicious.', 'amthanhchl_2005121495.mp3', '', 'Nghe', 1, 0, 'She woke up one morning and felt hungry. She did not eat anything last night. She got out of bed, and walked into her kitchen. The kitchen was clean. She thought about what to eat for breakfast. She opened her refrigerator and took out a carton of eggs. She opened her cabinet, and reached for a bowl. She cracked four eggs into the bowl. She stirred the eggs with a spoon. She turned on the stove, and placed a pan on the stove. She turned the knob on the stove. The fire was lit. She grabbed a stick of butter from the fridge. She tossed the butter on the hot pan. She grabbed the bowl of eggs and threw them on the pan. She scrambled them with a spatula. The eggs cooked in minutes. They smelled delicious.'),
(3092, 62, 'Reading a book is fun. Books make you smarter. They also make you a better reader. John loves to read books. He reads books on sunny days. He reads books on cloudy days, and he reads books on rainy days. John has read many books. He read his first book in second grade. His teachers were impressed. John was a good student. He had the highest grades in class. John learned a lot by reading books. He learned new words. He learned new verbs. He learned new adjectives. John reads every day. He has learned about the world. He has learned about history. He has learned about animals. He has learned about people. John loves to learn. He learns something new every day. John has many books. He has large bookshelves. They are full of books. John collects books. He has bought books at bookstores. John wants to read every book in the world.', 'amthanhchl_2069390435.mp3', '', 'Nghe', 1, 0, 'Reading a book is fun. Books make you smarter. They also make you a better reader. John loves to read books. He reads books on sunny days. He reads books on cloudy days, and he reads books on rainy days. John has read many books. He read his first book in second grade. His teachers were impressed. John was a good student. He had the highest grades in class. John learned a lot by reading books. He learned new words. He learned new verbs. He learned new adjectives. John reads every day. He has learned about the world. He has learned about history. He has learned about animals. He has learned about people. John loves to learn. He learns something new every day. John has many books. He has large bookshelves. They are full of books. John collects books. He has bought books at bookstores. John wants to read every book in the world.'),
(3093, 61, 'Jason made a new friend. His name is Daniel. Daniel only has one arm. He lost it in a car accident as a child. Jason really enjoyed Daniel\'s company. He invited Daniel out with some other friends. Jason was sure the other guys would like Daniel, too. \"Meet us at the restaurant,\" said Jason. Daniel walked into the restaurant. All the other guys stared at him. Daniel got very nervous. \"I hope they don\'t make fun of my arm,\" he thought. He really wanted to become friends with Jason\'s buddies. \"Wow,\" said one of the guys. \"That\'s a really nice shirt!\" Daniel was relieved. He was invited along every week after that.', 'amthanhchl_959374687.mp3', '', 'Nghe', 1, 0, 'Jason made a new friend. His name is Daniel. Daniel only has one arm. He lost it in a car accident as a child. Jason really enjoyed Daniel\'s company. He invited Daniel out with some other friends. Jason was sure the other guys would like Daniel, too. \"Meet us at the restaurant,\" said Jason. Daniel walked into the restaurant. All the other guys stared at him. Daniel got very nervous. \"I hope they don\'t make fun of my arm,\" he thought. He really wanted to become friends with Jason\'s buddies. \"Wow,\" said one of the guys. \"That\'s a really nice shirt!\" Daniel was relieved. He was invited along every week after that.'),
(3094, 75, 'Steven loved almost everything about his grandma. There was only one thing he hated. She always knitted sweaters for him. Steven understood that she did it to be nice. However, all the sweaters were very ugly. Steven visited her once a week. She had a new sweater for him each time. Steven lived in a small apartment. There was no room for him to keep all the sweaters. He had to give all of them away. \"Grandma will never find out,\" he thought. One day, Steven\'s grandma visited him by surprise. She asked to see his sweaters. \"Someone stole all of them!\" he said. \"They were too nice.\" She made him ten more by the next month.', 'amthanhchl_791535441.mp3', '', 'Nghe', 1, 0, 'Steven loved almost everything about his grandma. There was only one thing he hated. She always knitted sweaters for him. Steven understood that she did it to be nice. However, all the sweaters were very ugly. Steven visited her once a week. She had a new sweater for him each time. Steven lived in a small apartment. There was no room for him to keep all the sweaters. He had to give all of them away. \"Grandma will never find out,\" he thought. One day, Steven\'s grandma visited him by surprise. She asked to see his sweaters. \"Someone stole all of them!\" he said. \"They were too nice.\" She made him ten more by the next month.'),
(3095, 76, 'Dorothy had very curly hair. She hated it. \"It\'s too big,\" she always complained. Dorothy wanted to be an actress. All the actresses she knew had straight hair. It always looked perfect and smooth. Every morning, Dorothy was up at 5:00 a.m. She spent two hours straightening her hair. One morning, Dorothy had a big acting audition. She was running very late. There was no time to straighten her hair. \"I\'m never going to get the job with this hair,\" she thought. She was wrong. As soon as the director saw Dorothy, she was hired. \"Your hair stands out so much,\" he said. \"You must love it!\" \"Of course I do!\" replied Dorothy.', 'amthanhchl_1318849074.mp3', '', 'Nghe', 1, 0, 'Dorothy had very curly hair. She hated it. \"It\'s too big,\" she always complained. Dorothy wanted to be an actress. All the actresses she knew had straight hair. It always looked perfect and smooth. Every morning, Dorothy was up at 5:00 a.m. She spent two hours straightening her hair. One morning, Dorothy had a big acting audition. She was running very late. There was no time to straighten her hair. \"I\'m never going to get the job with this hair,\" she thought. She was wrong. As soon as the director saw Dorothy, she was hired. \"Your hair stands out so much,\" he said. \"You must love it!\" \"Of course I do!\" replied Dorothy.'),
(3096, 79, 'Lisa grew up in a huge family. She had six older sisters. All of them were very beautiful. This made Lisa feel very bad. She knew she looked nothing like them. Lisa had even heard people say she was the ugly sister. As teens the girls spent every weekend out on dates. Lisa always stayed home alone. Her sisters spent their days combing their hair and putting on makeup. Lisa spent her days reading and studying. Her sisters laughed at her a lot. As adults, all her sisters got married young. They all had handsome husbands with no brains or jobs. Lisa went to college. She became a rich scientist and traveled the world. She was the one laughing now.', 'amthanhchl_818981771.mp3', '', 'Nghe', 1, 0, 'Lisa grew up in a huge family. She had six older sisters. All of them were very beautiful. This made Lisa feel very bad. She knew she looked nothing like them. Lisa had even heard people say she was the ugly sister. As teens the girls spent every weekend out on dates. Lisa always stayed home alone. Her sisters spent their days combing their hair and putting on makeup. Lisa spent her days reading and studying. Her sisters laughed at her a lot. As adults, all her sisters got married young. They all had handsome husbands with no brains or jobs. Lisa went to college. She became a rich scientist and traveled the world. She was the one laughing now.'),
(3097, 134, 'Kevin asked Michelle on a date. He wanted to go snowboarding. \"I love snowboarding!\" said Michelle. This was a lie. She had never been snowboarding. She wanted to impress Kevin. \"That\'s great!\" said Kevin. \"Then we can go to the advanced slope.\" Michelle was terrified. The top of the advanced slope was extremely high. It was too late to say the truth. \"This can\'t be that hard,\" she thought. \"I just have to keep my balance.\" Michelle flew off the hill. She stayed standing for less than two second. She looked like a giant snowball by the time she reached the bottom of the slope. Kevin felt bad for her. He hugged her tight to get her warm. Her plan worked out after all.', 'amthanhchl_2039556458.mp3', '', 'Nghe', 1, 0, 'Kevin asked Michelle on a date. He wanted to go snowboarding. \"I love snowboarding!\" said Michelle. This was a lie. She had never been snowboarding. She wanted to impress Kevin. \"That\'s great!\" said Kevin. \"Then we can go to the advanced slope.\" Michelle was terrified. The top of the advanced slope was extremely high. It was too late to say the truth. \"This can\'t be that hard,\" she thought. \"I just have to keep my balance.\" Michelle flew off the hill. She stayed standing for less than two second. She looked like a giant snowball by the time she reached the bottom of the slope. Kevin felt bad for her. He hugged her tight to get her warm. Her plan worked out after all.'),
(3098, 137, 'John and his friends were going on a road trip. They were driving from Los Angeles to Washington. John had everything planned out. He had prepared CDs with their favorite songs. They would sing along to them the whole way. He even packed his trunk full of their favorite snacks. John picked up his friends early in the morning. He showed them a map. It was full of dots. \"These are all the stops we should make,\" he said. John wanted to see the Golden Gate Bridge, the Grand Canyon, Old Faithful, and many other monuments. \"What song should we hear first?\" asked John. All his friends were already asleep. They stayed this way the whole trip.', 'amthanhchl_702678315.mp3', '', 'Nghe', 1, 0, 'John and his friends were going on a road trip. They were driving from Los Angeles to Washington. John had everything planned out. He had prepared CDs with their favorite songs. They would sing along to them the whole way. He even packed his trunk full of their favorite snacks. John picked up his friends early in the morning. He showed them a map. It was full of dots. \"These are all the stops we should make,\" he said. John wanted to see the Golden Gate Bridge, the Grand Canyon, Old Faithful, and many other monuments. \"What song should we hear first?\" asked John. All his friends were already asleep. They stayed this way the whole trip.'),
(3099, 138, 'George\'s best friend was visiting him. Joseph lived in Arizona. George moved to Los Angeles two years ago. He hadn\'t seen Joseph since then. George wanted his friend to have fun. He wanted to convince him to move to Los Angeles with him. George had a great idea. He would take his friend to Six Flags. They didn\'t have big roller coasters in Arizona. George and Joseph got on a ride called Tatsu. It was huge and had more than five loops. Joseph screamed more than any other persons. \"Isn\'t this great?\" asked George. \"If you move here, we\'ll be coming here all the time!\" Joseph never returned to Los Angeles again.', 'amthanhchl_103523029.mp3', '', 'Nghe', 1, 0, 'George\'s best friend was visiting him. Joseph lived in Arizona. George moved to Los Angeles two years ago. He hadn\'t seen Joseph since then. George wanted his friend to have fun. He wanted to convince him to move to Los Angeles with him. George had a great idea. He would take his friend to Six Flags. They didn\'t have big roller coasters in Arizona. George and Joseph got on a ride called Tatsu. It was huge and had more than five loops. Joseph screamed more than any other persons. \"Isn\'t this great?\" asked George. \"If you move here, we\'ll be coming here all the time!\" Joseph never returned to Los Angeles again.'),
(3100, 299, 'Sea World is one of the most famous parks in the world. Thousands of people visit each year. Most of them go to see the dolphins and whales perform tricks. This is something they could never see in the wild. Sea World has been under a lot of pressure lately. Thousands of people have been protesting the parks. These people say that dolphins and whales should not be forced to live in such small spaces. They should also never be forced to perform pointless tricks. Most people are starting to agree with this. Sea World will hopefully start listening to the protesters soon.', 'amthanhchl_1527234339.mp3', '', 'Nghe', 1, 0, 'Sea World is one of the most famous parks in the world. Thousands of people visit each year. Most of them go to see the dolphins and whales perform tricks. This is something they could never see in the wild. Sea World has been under a lot of pressure lately. Thousands of people have been protesting the parks. These people say that dolphins and whales should not be forced to live in such small spaces. They should also never be forced to perform pointless tricks. Most people are starting to agree with this. Sea World will hopefully start listening to the protesters soon.'),
(3101, 300, 'Helen had nothing to do one Saturday night. \"Let\'s go to a Drive-In theatre,\" said Donna. Helen had no idea what that was. Donna told her she would love it. Helen agreed to go. Drive-In theatres play movies outdoors. People park their cars in front of a giant screen. They each get a pair of speakers. Everyone watches the movie from their cars. Helen had seen many of them in old movies. \"This is where people used to go on dates,\" she said. She had no idea they still existed. The girls watched a horror movie. It was scarier than watching it in a room with a bunch of people. \"They should bring these back,\" said Donna.', 'amthanhchl_1531252003.mp3', '', 'Nghe', 1, 1, 'Helen had nothing to do one Saturday night. \"Let\'s go to a Drive-In theatre,\" said Donna. Helen had no idea what that was. Donna told her she would love it. Helen agreed to go. Drive-In theatres play movies outdoors. People park their cars in front of a giant screen. They each get a pair of speakers. Everyone watches the movie from their cars. Helen had seen many of them in old movies. \"This is where people used to go on dates,\" she said. She had no idea they still existed. The girls watched a horror movie. It was scarier than watching it in a room with a bunch of people. \"They should bring these back,\" said Donna.'),
(3102, 300, 'Helen had nothing to do one Saturday night. \"Let\'s go to a Drive-In theatre,\" said Donna. Helen had no idea what that was. Donna told her she would love it. Helen agreed to go. Drive-In theatres play movies outdoors. People park their cars in front of a giant screen. They each get a pair of speakers. Everyone watches the movie from their cars. Helen had seen many of them in old movies. \"This is where people used to go on dates,\" she said. She had no idea they still existed. The girls watched a horror movie. It was scarier than watching it in a room with a bunch of people. \"They should bring these back,\" said Donna.', 'amthanhchl_1687818077.mp3', '', 'Nghe', 1, 0, 'Helen had nothing to do one Saturday night. \"Let\'s go to a Drive-In theatre,\" said Donna. Helen had no idea what that was. Donna told her she would love it. Helen agreed to go. Drive-In theatres play movies outdoors. People park their cars in front of a giant screen. They each get a pair of speakers. Everyone watches the movie from their cars. Helen had seen many of them in old movies. \"This is where people used to go on dates,\" she said. She had no idea they still existed. The girls watched a horror movie. It was scarier than watching it in a room with a bunch of people. \"They should bring these back,\" said Donna.'),
(3103, 301, 'Robert\'s family got together every Sunday. They always had lunch together. Every week, they went to the same restaurant. It was an \"All-You-Can-Eat Buffet\". Robert\'s family loved eating. This was the perfect restaurant for them. Robert\'s mom always ate the most. She would serve herself at least four plates for one meal. His dad was a picky eater. The buffet gave him plenty of options. Aunt Nancy loved the buffet the most. She always brought a bag with her. She would make sure no one was looking at her. Then, she would drop food into the bag. Her bag was three times bigger than before by the time she left.', 'amthanhchl_1882067116.mp3', '', 'Nghe', 1, 0, 'Robert\'s family got together every Sunday. They always had lunch together. Every week, they went to the same restaurant. It was an \"All-You-Can-Eat Buffet\". Robert\'s family loved eating. This was the perfect restaurant for them. Robert\'s mom always ate the most. She would serve herself at least four plates for one meal. His dad was a picky eater. The buffet gave him plenty of options. Aunt Nancy loved the buffet the most. She always brought a bag with her. She would make sure no one was looking at her. Then, she would drop food into the bag. Her bag was three times bigger than before by the time she left.');
