(3104, 63, 'Tom just got hired at the ice cream shop. It was called Creamy Goodness. It was a five-minute walk from his house. Today was his first day on the job. He was nervous. He was also excited. He showed up in his uniform. He was early to the job. He wanted to make a good impression.<br/><br/>His first task was to open the shop. He had to prepare the ice cream. He also had to set up the tables and the chairs for the customers. He had to clean all the equipment. He had to make sure everything was ready. His manager helped him get ready. His coworkers also helped. He worked as a cashier. He scooped the ice cream. Tom loved his job.', 'amthanhchl_2026100560.mp3', '', 'Nghe', 1, 0, 'Tom just got hired at the ice cream shop. It was called Creamy Goodness. It was a five-minute walk from his house. Today was his first day on the job. He was nervous. He was also excited. He showed up in his uniform. He was early to the job. He wanted to make a good impression.<br/><br/>His first task was to open the shop. He had to prepare the ice cream. He also had to set up the tables and the chairs for the customers. He had to clean all the equipment. He had to make sure everything was ready. His manager helped him get ready. His coworkers also helped. He worked as a cashier. He scooped the ice cream. Tom loved his job.'),
(3105, 64, 'Joe is a sale associate. He has a lot of duties. He helps customers find things. Customers can be annoying. They always think they\'re right. Joe always has to be nice to them. Joe also answers phone calls. People ask about products in the store.<br/><br/>Joe cleans the bathroom. That\'s the worst part. It\'s very dirty. He has to pick up trash. He has to refill the soap. Joe is also at the cash register. He scans items. He gives people change. He gives back money for returns. He thinks his job is okay, but he plans to quit in a few years.', 'amthanhchl_52783565.mp3', '', 'Nghe', 1, 0, 'Joe is a sale associate. He has a lot of duties. He helps customers find things. Customers can be annoying. They always think they\'re right. Joe always has to be nice to them. Joe also answers phone calls. People ask about products in the store.<br/><br/>Joe cleans the bathroom. That\'s the worst part. It\'s very dirty. He has to pick up trash. He has to refill the soap. Joe is also at the cash register. He scans items. He gives people change. He gives back money for returns. He thinks his job is okay, but he plans to quit in a few years.'),
(3106, 205, 'Kenneth went to the movie theater. He likes to watch action movies. The more action, the better. He waited for his friends. They had planned to meet at 5 p.m. He waited outside. Twenty minutes passed. His friends were not there. He called one of them. It went straight to voicemail. He wondered where his friends were.<br/><br/>He was getting upset. He called his other friends. They did not answer. He went back to the theater. He bought a ticket. He went to the concession stand. He bought popcorn and soda. He went inside the viewing room. He found a comfy seat. He sat down. He watched the movie all by himself.', 'amthanhchl_2060252144.mp3', '', 'Nghe', 1, 0, 'Kenneth went to the movie theater. He likes to watch action movies. The more action, the better. He waited for his friends. They had planned to meet at 5 p.m. He waited outside. Twenty minutes passed. His friends were not there. He called one of them. It went straight to voicemail. He wondered where his friends were.<br/><br/>He was getting upset. He called his other friends. They did not answer. He went back to the theater. He bought a ticket. He went to the concession stand. He bought popcorn and soda. He went inside the viewing room. He found a comfy seat. He sat down. He watched the movie all by himself.'),
(3107, 206, 'Danielle looked in the mirror. Her hair was oily. She needed to wash it. It takes her 30 minutes to wash her hair. But she had a date in 15 minutes. She didn\'t want to look bad though. She got a table cloth. It had pink flowers on it. She wrapped it around her hair.<br/><br/>Now her hair was all covered. She went downstairs. Her brother started laughing at her. He told her to look in the mirror. She looked into a mirror. She looked ridiculous./span> She was jealous of her brother. Her brother had short hair. It only took him 5 minutes to wash his hair.', 'amthanhchl_1651560928.mp3', '', 'Nghe', 1, 0, 'Danielle looked in the mirror. Her hair was oily. She needed to wash it. It takes her 30 minutes to wash her hair. But she had a date in 15 minutes. She didn\'t want to look bad though. She got a table cloth. It had pink flowers on it. She wrapped it around her hair.<br/><br/>Now her hair was all covered. She went downstairs. Her brother started laughing at her. He told her to look in the mirror. She looked into a mirror. She looked ridiculous./span> She was jealous of her brother. Her brother had short hair. It only took him 5 minutes to wash his hair.'),
