(3222, 306, 'Kỳ làm đổ một túi gồm 13 hạt và một đàn chó đã ăn hết chúng. Con chó lớn nhất ăn 7 hạt. Những con chó khác đã ăn bao nhiêu hạt?', '', '', 'toan', 1, 0, 'Kỳ làm đổ một túi gồm 13 hạt và một đàn chó đã ăn hết chúng. Con chó lớn nhất ăn 7 hạt. Những con chó khác đã ăn bao nhiêu hạt?'),
(3223, 306, 'Năm ngoái, mèo của Kỳ đã bắt được tổng cộng 14 con chuột và chim. Trong đó mèo bắt được 8 con chuột. Vậy mèo đã bắt được bao nhiêu con chim vào năm ngoái?', '', '', 'toan', 1, 0, 'Năm ngoái, mèo của Kỳ đã bắt được tổng cộng 14 con chuột và chim. Trong đó mèo bắt được 8 con chuột. Vậy mèo đã bắt được bao nhiêu con chim vào năm ngoái?'),
(3224, 306, 'Có tổng cộng 13 cuốn sách trên kệ. Sau đó, 4 cuốn sách đã bị lấy đi. Còn lại bao nhiêu cuốn sách?', '', '', 'toan', 1, 0, 'Có tổng cộng 13 cuốn sách trên kệ. Sau đó, 4 cuốn sách đã bị lấy đi. Còn lại bao nhiêu cuốn sách?'),
(3225, 306, 'Hoàng đã tổ chức một buổi bán đồ cũ tổng cộng 12 đồ chơi và sách đã bán. Bạn bán được 9 món đồ chơi. Anh ấy đã bán được bao nhiêu cuốn sách?', '', '', 'toan', 1, 0, 'Hoàng đã tổ chức một buổi bán đồ cũ tổng cộng 12 đồ chơi và sách đã bán. Bạn bán được 9 món đồ chơi. Anh ấy đã bán được bao nhiêu cuốn sách?'),
(3226, 306, 'Lisa có 10 viên bi trong bộ sưu tập của cô. Nếu cô ấy đưa 8 viên bi cho người bạn thân nhất của mình, cô ấy sẽ còn lại bao nhiêu viên bi?', '', '', 'toan', 1, 0, 'Lisa có 10 viên bi trong bộ sưu tập của cô. Nếu cô ấy đưa 8 viên bi cho người bạn thân nhất của mình, cô ấy sẽ còn lại bao nhiêu viên bi?'),
(3227, 306, 'Ông đầu bếp đã giúp sấy khô các món ăn. Ông đã sấy khô tổng cộng 11 gói lớn và nhỏ. Ông sấy khô 3 gói lớn. Có bao nhiêu ly nhỏ anh ấy đã làm khô?', '', '', 'toan', 1, 0, 'Ông đầu bếp đã giúp sấy khô các món ăn. Ông đã sấy khô tổng cộng 11 gói lớn và nhỏ. Ông sấy khô 3 gói lớn. Có bao nhiêu ly nhỏ anh ấy đã làm khô?'),
(3228, 306, 'Có tổng cộng 17 con chó sói trong một khu rừng và 7 trong số chúng là cái. Có bao nhiêu con đực?', '', '', 'toan', 1, 0, 'Có tổng cộng 17 con chó sói trong một khu rừng và 7 trong số chúng là cái. Có bao nhiêu con đực?'),
(3229, 306, 'Tiệm bánh có 12 túi đường. Sau đó, một nhân viên đã sử dụng 7 túi đường để làm một số bánh. Hỏi bao nhiêu đường còn lại?', '', '', 'toan', 1, 0, 'Tiệm bánh có 12 túi đường. Sau đó, một nhân viên đã sử dụng 7 túi đường để làm một số bánh. Hỏi bao nhiêu đường còn lại?'),
(3230, 306, 'Bình đang thu thập vỏ sò trên bãi biển. Cô tìm thấy tổng cộng 10 vỏ ốc xà cừ và ốc sên. 7 trong số đó là vỏ ốc xà cừ. Hỏi có bao nhiêu vỏ ốc là vỏ ốc sên?', '', '', 'toan', 1, 0, 'Bình đang thu thập vỏ sò trên bãi biển. Cô tìm thấy tổng cộng 10 vỏ ốc xà cừ và ốc sên. 7 trong số đó là vỏ ốc xà cừ. Hỏi có bao nhiêu vỏ ốc là vỏ ốc sên?'),
(3231, 306, 'Một đại lý xe hơi có tổng cộng 14 chiếc xe lớn và nhỏ. trong đó có 3 chiếc ô tô nhỏ. Hỏi đại lý có bao nhiêu chiếc xe lớn?', '', '', 'toan', 1, 0, 'Một đại lý xe hơi có tổng cộng 14 chiếc xe lớn và nhỏ. trong đó có 3 chiếc ô tô nhỏ. Hỏi đại lý có bao nhiêu chiếc xe lớn?'),
(3232, 306, 'Có 17 học sinh trong lớp học bơi. 8 học sinh là nữ. Hỏi có bao nhiêu học sinh là nam?', '', '', 'toan', 1, 0, 'Có 17 học sinh trong lớp học bơi. 8 học sinh là nữ. Hỏi có bao nhiêu học sinh là nam?'),
(3233, 306, 'Kiệt đã có một bữa tiệc sinh nhật và 11 bạn cùng lớp đã đến. Trong đó có 2 bạn trai trong lớpanh đến. Hỏi có bao nhiêu cô gái từ lớp của Kiệt đến bữa tiệc sinh nhật của bạn ấy?', '', '', 'toan', 1, 1, 'Kiệt đã có một bữa tiệc sinh nhật và 11 bạn cùng lớp đã đến. Trong đó có 2 bạn trai trong lớpanh đến. Hỏi có bao nhiêu cô gái từ lớp của Kiệt đến bữa tiệc sinh nhật của bạn ấy?'),
(3234, 306, 'Kiệt đã có một bữa tiệc sinh nhật và 11 bạn cùng lớp đã đến. Trong đó có 2 bạn trai trong lớp anh đến. Hỏi có bao nhiêu cô gái từ lớp của Kiệt đến bữa tiệc sinh nhật của bạn ấy?', '', '', 'toan', 1, 0, 'Kiệt đã có một bữa tiệc sinh nhật và 11 bạn cùng lớp đã đến. Trong đó có 2 bạn trai trong lớp anh đến. Hỏi có bao nhiêu cô gái từ lớp của Kiệt đến bữa tiệc sinh nhật của bạn ấy?'),
(3235, 306, 'Tại bãi biển, Huỳnh và anh trai Huệ đang thu thập vỏ sò cùng nhau, họ đã tìm thấy tổng cộng 16 vỏ sò. Huỳnh tìm thấy 2 trong số các vỏ sò. Có bao nhiêu vỏ sò mà anh trai Huệ của cô đã tìm thấy?', '', '', 'toan', 1, 0, 'Tại bãi biển, Huỳnh và anh trai Huệ đang thu thập vỏ sò cùng nhau, họ đã tìm thấy tổng cộng 16 vỏ sò. Huỳnh tìm thấy 2 trong số các vỏ sò. Có bao nhiêu vỏ sò mà anh trai Huệ của cô đã tìm thấy?'),
(3236, 306, 'Bình cần phải đứng trên 6 chiếc gối để lấy được hũ bánh quy. Anh lấy 3 cái gối từ trên giường. Anh ấy cần bao nhiêu gối nữa để lấy được hũ bánh quy?', '', '', 'toan', 1, 0, 'Bình cần phải đứng trên 6 chiếc gối để lấy được hũ bánh quy. Anh lấy 3 cái gối từ trên giường. Anh ấy cần bao nhiêu gối nữa để lấy được hũ bánh quy?'),
(3237, 306, 'Hòa có 12 xe cứu hỏa đồ chơi. Chỉ có 4 chiếc xe cứu hỏa có thang. Vậy bao nhiêu xe cứu hỏa không có thang?', '', '', 'toan', 1, 0, 'Hòa có 12 xe cứu hỏa đồ chơi. Chỉ có 4 chiếc xe cứu hỏa có thang. Vậy bao nhiêu xe cứu hỏa không có thang?'),
(3238, 306, 'Một nữ diễn viên sở hữu 16 đôi giày. 6 trong số các cặp đó là màu yêu thích của cô, đó là màu xanh lá cây. Nữ diễn viên sở hữu bao nhiêu đôi giày không có màu xanh lá cây?', '', '', 'toan', 1, 0, 'Một nữ diễn viên sở hữu 16 đôi giày. 6 trong số các cặp đó là màu yêu thích của cô, đó là màu xanh lá cây. Nữ diễn viên sở hữu bao nhiêu đôi giày không có màu xanh lá cây?'),
(3239, 306, 'Mạnh muốn sơn nhà màu xanh của mình. Cô ấy cần 17 lít sơn màu xanh và đã có 9 lít. Hỏi Anh ấy cần thêm bao nhiêu lít sơn màu xanh?', '', '', 'toan', 1, 0, 'Mạnh muốn sơn nhà màu xanh của mình. Cô ấy cần 17 lít sơn màu xanh và đã có 9 lít. Hỏi Anh ấy cần thêm bao nhiêu lít sơn màu xanh?'),
(3240, 306, 'Có tổng cộng 11 phụ nữ trong một trận bóng và 5 người đang buộc tóc lên. Hỏi có bao nhiêu phụ nữ đang thả tóc?', '', '', 'toan', 1, 0, 'Có tổng cộng 11 phụ nữ trong một trận bóng và 5 người đang buộc tóc lên. Hỏi có bao nhiêu phụ nữ đang thả tóc?'),
(3241, 306, 'Bố của Hoàng đã mua 12 cây cà chua. Anh trồng 3 cây cà chua ở vườn trước và phần còn lại ở vườn sau. Hỏi có bao nhiêu cây cà chua anh ấy đã trồng trong vườn sau?', '', '', 'toan', 1, 0, 'Bố của Hoàng đã mua 12 cây cà chua. Anh trồng 3 cây cà chua ở vườn trước và phần còn lại ở vườn sau. Hỏi có bao nhiêu cây cà chua anh ấy đã trồng trong vườn sau?'),
(3242, 306, 'Erik và những người bạn của cô đã thu thập 16 vỏ sò ở bãi biển. Có 3 vỏ là nguyên vẹn, những vỏ còn lại đã bị vỡ. Có bao nhiêu vỏ bị vỡ?', '', '', 'toan', 1, 0, 'Erik và những người bạn của cô đã thu thập 16 vỏ sò ở bãi biển. Có 3 vỏ là nguyên vẹn, những vỏ còn lại đã bị vỡ. Có bao nhiêu vỏ bị vỡ?'),
(3243, 306, 'Lớp của cô Quỳnh đã nuôi tổng cộng 18 con sâu nhộng và 4 con biến thành bướm. Có bao nhiêu con tằm không biến thành bướm?', '', '', 'toan', 1, 1, 'Lớp của cô Quỳnh đã nuôi tổng cộng 18 con sâu nhộng và 4 con biến thành bướm. Có bao nhiêu con tằm không biến thành bướm?'),
