(3284, 209, 'Cindy needed to return her dress. She tried it on at home earlier. It did not fit her. Today was the last day to return it. After today, she had to keep the dress. The store closes at 8 p.m. She started driving at 7:30 p.m.<br/><br/>It took her 20 minutes to get to the mall. She only had 10 minutes left to park her car and return her dress. Today was Saturday. There were too many cars in the parking lot. It took her 5 minutes to find a parking space. She ran out of the car, but she did not make it in time. The store was closed.', 'amthanhchl_1301090911.mp3', '', 'Nghe', 1, 0, 'Cindy needed to return her dress. She tried it on at home earlier. It did not fit her. Today was the last day to return it. After today, she had to keep the dress. The store closes at 8 p.m. She started driving at 7:30 p.m.<br/><br/>It took her 20 minutes to get to the mall. She only had 10 minutes left to park her car and return her dress. Today was Saturday. There were too many cars in the parking lot. It took her 5 minutes to find a parking space. She ran out of the car, but she did not make it in time. The store was closed.'),
