(3288, 210, 'Eileen had to see the doctor. She had no appointment. She had to wait for two hours to see the doctor. She was bored. She forgot her phone. She didn\'t know what to do. She looked around. Everyone had a phone.<br/><br/>She looked to see if there were any magazines. Waiting rooms usually had magazines. There were magazines in Spanish. Eileen can\'t read Spanish. She turned on the TV. There was no cable. Eileen did not like local television. It was too boring. She turned off the TV. She tried to talk to the person next to her. The person ignored her. He was on his phone. She wished she brought her phone.', 'amthanhchl_620201954.mp3', '', 'Nghe', 1, 0, 'Eileen had to see the doctor. She had no appointment. She had to wait for two hours to see the doctor. She was bored. She forgot her phone. She didn\'t know what to do. She looked around. Everyone had a phone.<br/><br/>She looked to see if there were any magazines. Waiting rooms usually had magazines. There were magazines in Spanish. Eileen can\'t read Spanish. She turned on the TV. There was no cable. Eileen did not like local television. It was too boring. She turned off the TV. She tried to talk to the person next to her. The person ignored her. He was on his phone. She wished she brought her phone.'),
(3289, 210, 'Tom was hungry, but lazy too. He didn\'t want to cook. He didn\'t want to go to a restaurant. He didn\'t even want to heat up leftovers. He decided to have a pizza delivered to him. He went on a pizza website. He ordered a small pizza. He waited for the pizza to arrive.<br/><br/>Later, he heard the doorbell ring. He was too lazy to get up at first. He got up after five minutes. He opened the door. The pizza smelled so good. He paid the delivery man. He gave him a good tip, too. Tom sat back down on his couch. He ate the whole pizza. He was full.', 'amthanhchl_1907022983.mp3', '', 'Nghe', 1, 1, 'Tom was hungry, but lazy too. He didn\'t want to cook. He didn\'t want to go to a restaurant. He didn\'t even want to heat up leftovers. He decided to have a pizza delivered to him. He went on a pizza website. He ordered a small pizza. He waited for the pizza to arrive.<br/><br/>Later, he heard the doorbell ring. He was too lazy to get up at first. He got up after five minutes. He opened the door. The pizza smelled so good. He paid the delivery man. He gave him a good tip, too. Tom sat back down on his couch. He ate the whole pizza. He was full.'),
(3290, 211, 'Tom was hungry, but lazy too. He didn\'t want to cook. He didn\'t want to go to a restaurant. He didn\'t even want to heat up leftovers. He decided to have a pizza delivered to him. He went on a pizza website. He ordered a small pizza. He waited for the pizza to arrive.<br/><br/>Later, he heard the doorbell ring. He was too lazy to get up at first. He got up after five minutes. He opened the door. The pizza smelled so good. He paid the delivery man. He gave him a good tip, too. Tom sat back down on his couch. He ate the whole pizza. He was full.', 'amthanhchl_1575916499.mp3', '', 'Nghe', 1, 0, 'Tom was hungry, but lazy too. He didn\'t want to cook. He didn\'t want to go to a restaurant. He didn\'t even want to heat up leftovers. He decided to have a pizza delivered to him. He went on a pizza website. He ordered a small pizza. He waited for the pizza to arrive.<br/><br/>Later, he heard the doorbell ring. He was too lazy to get up at first. He got up after five minutes. He opened the door. The pizza smelled so good. He paid the delivery man. He gave him a good tip, too. Tom sat back down on his couch. He ate the whole pizza. He was full.'),
(3291, 212, 'Bob had been exercising every day for a year. He had also been eating healthy. He wanted to see how much weight he lost. He stepped on the scale. He closed his eyes. He was scared. What if he gained weight? He opened his eyes slowly. He looked down. He smiled. He lost 50 pounds. He jumped up and down. He wanted to celebrate.<br/><br/>He went to his favorite burger place. He ordered the jumbo size. He felt bad at first, but he deserved it. He ordered a large size of fries. He used five ketchup packets. He took his first bite. It tasted so good. He would be healthy again tomorrow.', 'amthanhchl_1523650217.mp3', '', 'Nghe', 1, 0, 'Bob had been exercising every day for a year. He had also been eating healthy. He wanted to see how much weight he lost. He stepped on the scale. He closed his eyes. He was scared. What if he gained weight? He opened his eyes slowly. He looked down. He smiled. He lost 50 pounds. He jumped up and down. He wanted to celebrate.<br/><br/>He went to his favorite burger place. He ordered the jumbo size. He felt bad at first, but he deserved it. He ordered a large size of fries. He used five ketchup packets. He took his first bite. It tasted so good. He would be healthy again tomorrow.'),
(3292, 213, 'Marie was messy. Cassie was clean. The two girls were roommates. Marie had a bunch of clothes on her bed. Cassie just had a blanket on hers. Cassie told Marie to put her clothes somewhere else. Marie ignored her.<br/><br/>Marie had food from last week on her desk. It smelled bad. Cassie told her to throw it away. Marie said no. Cassie threw it away herself. Marie yelled at her. She was mad that Cassie touched her things. Cassie yelled at her back. She was mad at Marie for being messy. Marie left and slammed the door. Cassie was all alone. It was a good time to clean.', 'amthanhchl_169006634.mp3', '', 'Nghe', 1, 0, 'Marie was messy. Cassie was clean. The two girls were roommates. Marie had a bunch of clothes on her bed. Cassie just had a blanket on hers. Cassie told Marie to put her clothes somewhere else. Marie ignored her.<br/><br/>Marie had food from last week on her desk. It smelled bad. Cassie told her to throw it away. Marie said no. Cassie threw it away herself. Marie yelled at her. She was mad that Cassie touched her things. Cassie yelled at her back. She was mad at Marie for being messy. Marie left and slammed the door. Cassie was all alone. It was a good time to clean.'),
(3293, 214, 'Jessica was a college student. She did not know how to cook well. She does not have much time either. She is always busy. She has an important test coming up. She grabs a bowl of instant noodles. Instant noodles are easy to prepare. She rips off the lid halfway. She rips the seasoning packet. The seasoning is what makes the noodles taste good.<br/><br/>She pours the seasoning on the noodles. She fills the bowl with water. She closes the lid. She puts the bowl in the microwave. She heats it up for three minutes. She sits down. She studies while she waits. She hears the \"ding.\" It\'s ready!', 'amthanhchl_951021341.mp3', '', 'Nghe', 1, 0, 'Jessica was a college student. She did not know how to cook well. She does not have much time either. She is always busy. She has an important test coming up. She grabs a bowl of instant noodles. Instant noodles are easy to prepare. She rips off the lid halfway. She rips the seasoning packet. The seasoning is what makes the noodles taste good.<br/><br/>She pours the seasoning on the noodles. She fills the bowl with water. She closes the lid. She puts the bowl in the microwave. She heats it up for three minutes. She sits down. She studies while she waits. She hears the \"ding.\" It\'s ready!'),
(3294, 65, 'Alvin wants a new laptop. His parents are poor though. His mom recently lost her job. His dad recently quit his job. Alvin knows that he can\'t ask his parents for a laptop. He decides to ask his rich uncle Todd. He drives over to Todd\'s house. Todd\'s house is beautiful. It has three stories. There is a chandelier on the ceiling. There are expensive paintings all over the place. There are five bedrooms and four bathrooms. Alvin wishes he could live there.<br/><br/><br/> <br/>Todd offers him something to eat. Alvin says, \"No, thanks. I already ate.\" Todd asks him why he is coming. Alvin does not know what to say. He does not want to come off as rude. \"My laptop is really old, and I need a laptop for school. I would ask my parents, but they don\'t have jobs anymore,\" Alvin says.<br/><br/>\"I understand,\" Todd says. Todd takes out $800 from his wallet and gives it to Alvin. Alvin jumps up and down. He has never felt so happy in his entire life. His mom asks Alvin why he is so happy. Alvin does not say anything. He doesn\'t want to make his mom feel bad.', 'amthanhchl_710393175.mp3', '', 'Nghe', 1, 0, 'Alvin wants a new laptop. His parents are poor though. His mom recently lost her job. His dad recently quit his job. Alvin knows that he can\'t ask his parents for a laptop. He decides to ask his rich uncle Todd. He drives over to Todd\'s house. Todd\'s house is beautiful. It has three stories. There is a chandelier on the ceiling. There are expensive paintings all over the place. There are five bedrooms and four bathrooms. Alvin wishes he could live there.<br/><br/><br/> <br/>Todd offers him something to eat. Alvin says, \"No, thanks. I already ate.\" Todd asks him why he is coming. Alvin does not know what to say. He does not want to come off as rude. \"My laptop is really old, and I need a laptop for school. I would ask my parents, but they don\'t have jobs anymore,\" Alvin says.<br/><br/>\"I understand,\" Todd says. Todd takes out $800 from his wallet and gives it to Alvin. Alvin jumps up and down. He has never felt so happy in his entire life. His mom asks Alvin why he is so happy. Alvin does not say anything. He doesn\'t want to make his mom feel bad.'),
(3295, 66, 'It\'s hard to get into college these days. It used to be a lot easier. Now it\'s even not enough to get good grades. You need to have good grades in advanced classes. You need to do some extracurriculars. Extracurriculars are activities you do outside of class such as playing basketball, playing the violin, singing, and more. You need to have a high score on the SAT or ACT. The SAT and ACT are used to test what you know. They both have questions on various subjects.<br/><br/><br/> <br/>You need to have some leadership positions. It is not just enough to be a member in a club. You need to be the president or the vice president. You also need letters of recommendation, letters in which your teachers, coaches, or bosses write about your abilities and personality. It also helps if you won some awards. It shows that you can achieve something.<br/><br/>You also have to write good essays that show who you are as a person. Colleges want people who have interesting personalities and stories. Students with good grades but boring essays will not get into the college of their dreams. Students should not be sad if they don\'t get into the college of their dreams. They need to know that getting into college is tougher as years go by.', 'amthanhchl_462323669.mp3', '', 'Nghe', 1, 0, 'It\'s hard to get into college these days. It used to be a lot easier. Now it\'s even not enough to get good grades. You need to have good grades in advanced classes. You need to do some extracurriculars. Extracurriculars are activities you do outside of class such as playing basketball, playing the violin, singing, and more. You need to have a high score on the SAT or ACT. The SAT and ACT are used to test what you know. They both have questions on various subjects.<br/><br/><br/> <br/>You need to have some leadership positions. It is not just enough to be a member in a club. You need to be the president or the vice president. You also need letters of recommendation, letters in which your teachers, coaches, or bosses write about your abilities and personality. It also helps if you won some awards. It shows that you can achieve something.<br/><br/>You also have to write good essays that show who you are as a person. Colleges want people who have interesting personalities and stories. Students with good grades but boring essays will not get into the college of their dreams. Students should not be sad if they don\'t get into the college of their dreams. They need to know that getting into college is tougher as years go by.'),
(3296, 67, 'Marissa was born with a physical imperfection. She has a unibrow. A unibrow is one long brow. Most people have two eyebrows. People make fun of her for having a unibrow. A lot of people don\'t want to be friends with her. She does have two good friends though. Heather and Joe are Marissa\'s best friends. They accept Marissa for who she is. <br/>Heather was approached by the popular kids. The leader of the popular kids was Amy. Amy offered Heather a spot in her group if she left Marissa. Heather thought about it. Although she loved Marissa, she always dreamed of being popular. She told Amy that she had to think about the offer.<br/>Heather told Joe what happened. Joe was mad that Heather had to even think about it. \"You have been friends with Marissa forever,\" Joe said. Heather thought about it. She thought about all the times she and Marissa did homework together, ate together, and laughed together. It wasn\'t worth it to give all that up for popularity. She called Amy. \"I\'m never leaving Marissa, she\'s beautiful on the inside.\" After talking to Amy, Heather asked Marissa and Joe to hang out.', 'amthanhchl_1505451905.mp3', '', 'Nghe', 1, 0, 'Marissa was born with a physical imperfection. She has a unibrow. A unibrow is one long brow. Most people have two eyebrows. People make fun of her for having a unibrow. A lot of people don\'t want to be friends with her. She does have two good friends though. Heather and Joe are Marissa\'s best friends. They accept Marissa for who she is. <br/>Heather was approached by the popular kids. The leader of the popular kids was Amy. Amy offered Heather a spot in her group if she left Marissa. Heather thought about it. Although she loved Marissa, she always dreamed of being popular. She told Amy that she had to think about the offer.<br/>Heather told Joe what happened. Joe was mad that Heather had to even think about it. \"You have been friends with Marissa forever,\" Joe said. Heather thought about it. She thought about all the times she and Marissa did homework together, ate together, and laughed together. It wasn\'t worth it to give all that up for popularity. She called Amy. \"I\'m never leaving Marissa, she\'s beautiful on the inside.\" After talking to Amy, Heather asked Marissa and Joe to hang out.'),
(3297, 68, 'Abby lost her mom yesterday. Her mom got into a car accident. A drunk driver hit her mom\'s car. The drunk driver is now in jail. Abby visited the jail to make him feel bad. \"You know what you did, right?\" Abby asked. The drunk driver nodded and said, \"I\'m sorry.\" He started crying. \"\'Sorry\' is not going to bring my mom back. Your carelessness took away my mom.\"<br/><br/><br/> <br/>The drunk driver continued to cry. \"I drank, because I was feeling lonely.\" Abby was mad and left the jail. She didn\'t want to see his face ever again. She wanted him to go to jail for life. Abby could barely wake up. She requested to take a week off her work. She loved her job, but she could not stop thinking about her mom.<br/><br/>Abby\'s husband told her to do something instead of watching TV all day. Abby agreed with him. It was time for her to start doing something productive. She wanted to do something that would make her mom proud. Abby created a program to prevent drunk driving. She wanted to give drunk people free rides. Abby visited colleges, clubs, and bars all across the country to encourage people not to drive when drinking.', 'amthanhchl_333022750.mp3', '', 'Nghe', 1, 0, 'Abby lost her mom yesterday. Her mom got into a car accident. A drunk driver hit her mom\'s car. The drunk driver is now in jail. Abby visited the jail to make him feel bad. \"You know what you did, right?\" Abby asked. The drunk driver nodded and said, \"I\'m sorry.\" He started crying. \"\'Sorry\' is not going to bring my mom back. Your carelessness took away my mom.\"<br/><br/><br/> <br/>The drunk driver continued to cry. \"I drank, because I was feeling lonely.\" Abby was mad and left the jail. She didn\'t want to see his face ever again. She wanted him to go to jail for life. Abby could barely wake up. She requested to take a week off her work. She loved her job, but she could not stop thinking about her mom.<br/><br/>Abby\'s husband told her to do something instead of watching TV all day. Abby agreed with him. It was time for her to start doing something productive. She wanted to do something that would make her mom proud. Abby created a program to prevent drunk driving. She wanted to give drunk people free rides. Abby visited colleges, clubs, and bars all across the country to encourage people not to drive when drinking.'),
(3298, 69, 'Kelly has been cheering since she was in elementary school. She is now in her last year of college cheering for her school\'s sports teams. She plans to be a professional cheerleader for the Lakers team. That was her dream. Her parents wanted her to do something more normal, like becoming a nurse or working at a law firm. Kelly ignored her parents.<br/><br/>Kelly and her teammates were cheering at their last basketball game. When Kelly stood on top of her teammate\'s shoulder, she fell down. Everyone was silent. Her teammates checked up on her and asked if she was okay. Kelly had to be taken to the hospital. Her leg was permanently injured. \"Can I ever be a professional cheerleader?\" she asked. \"I\'m afraid you cannot,\" the doctor said. Kelly felt that life was unfair.<br/><br/>Kelly was scared for the future. All of her friends already knew what they wanted to do after college. Kelly had to change her plans. She already canceled her audition with the Lakers cheerleaders. Kelly thought about what she wanted to do for a career. She still wanted to do something related to cheer. After some thinking, Kelly wanted to be a coach for high school cheerleaders.', 'amthanhchl_1702295238.mp3', '', 'Nghe', 1, 0, 'Kelly has been cheering since she was in elementary school. She is now in her last year of college cheering for her school\'s sports teams. She plans to be a professional cheerleader for the Lakers team. That was her dream. Her parents wanted her to do something more normal, like becoming a nurse or working at a law firm. Kelly ignored her parents.<br/><br/>Kelly and her teammates were cheering at their last basketball game. When Kelly stood on top of her teammate\'s shoulder, she fell down. Everyone was silent. Her teammates checked up on her and asked if she was okay. Kelly had to be taken to the hospital. Her leg was permanently injured. \"Can I ever be a professional cheerleader?\" she asked. \"I\'m afraid you cannot,\" the doctor said. Kelly felt that life was unfair.<br/><br/>Kelly was scared for the future. All of her friends already knew what they wanted to do after college. Kelly had to change her plans. She already canceled her audition with the Lakers cheerleaders. Kelly thought about what she wanted to do for a career. She still wanted to do something related to cheer. After some thinking, Kelly wanted to be a coach for high school cheerleaders.');
