(3299, 70, 'Kimberly seems like a normal teenage girl. She goes to high school; she has homework; she has problems with the popular girls; she argues with her parents. However, Kimberly has a secret power. She has super strength. She can lift up cars from the ground. She uses her strength to fight crime in her city. She has even been on the news!<br/><br/>Kimberly hides this secret from everyone except her younger brother and her parents. She doesn\'t want people to treat her differently. She feels that people might give her special treatment because she is a hero. She wants people to see her for who she truly is. To hide her identity, she wears a mask and green colored contacts. Her superhero outfit includes a cape and a stretchy purple suit.<br/><br/>Sometimes Kimberly does want to tell people she is a superhero, like when she was bullied by the popular girls. She came close to telling them one time after they destroyed her science project. Kimberly also has a sidekick who is her best friend. His superhero name is OttoBot, and his real name is Oliver. His power is his super speed. Oliver goes to the same school as Kimberly, but he does not keep his identity a secret.', 'amthanhchl_1444813153.mp3', '', 'Nghe', 1, 0, 'Kimberly seems like a normal teenage girl. She goes to high school; she has homework; she has problems with the popular girls; she argues with her parents. However, Kimberly has a secret power. She has super strength. She can lift up cars from the ground. She uses her strength to fight crime in her city. She has even been on the news!<br/><br/>Kimberly hides this secret from everyone except her younger brother and her parents. She doesn\'t want people to treat her differently. She feels that people might give her special treatment because she is a hero. She wants people to see her for who she truly is. To hide her identity, she wears a mask and green colored contacts. Her superhero outfit includes a cape and a stretchy purple suit.<br/><br/>Sometimes Kimberly does want to tell people she is a superhero, like when she was bullied by the popular girls. She came close to telling them one time after they destroyed her science project. Kimberly also has a sidekick who is her best friend. His superhero name is OttoBot, and his real name is Oliver. His power is his super speed. Oliver goes to the same school as Kimberly, but he does not keep his identity a secret.'),
