(3419, 71, 'Anna has a lucky jacket. Whenever she wears it, good things happen to her. She wore it on her final exam one time, and she got the highest grade in the class! The jacket is green with yellow stripes. It\'s really smelly, because Anna never washes it. She is scared that washing the jacket will wash away the luck. She keeps the jacket in a closet all by itself. No other clothes are in the closet.<br/><br/>Anna had an important interview for a job. She was very nervous about it. She wanted to wear the jacket, but the jacket was not appropriate for the interview. She needed to wear nice clothes. She decided to wear the jacket under a plain gray sweater. Perfect plan, she thought.<br/><br/>When Anna entered the interview room, she started to sweat. She wondered why it was so hot. She realized that the heater was on. She sat down across from the interviewer. \"Anna, you\'re sweating. You should take your sweater off.\" Anna laughed nervously. \"I\'m fine,\" she said. By the end of the interview, there was a sweat stain on Anna\'s sweater. She left the interview feeling unsure. A week later Anna got a phone call from the boss. The boss offered her the job! The lucky jacket worked!', 'amthanhchl_394412260.mp3', '', 'Nghe', 1, 0, 'Anna has a lucky jacket. Whenever she wears it, good things happen to her. She wore it on her final exam one time, and she got the highest grade in the class! The jacket is green with yellow stripes. It\'s really smelly, because Anna never washes it. She is scared that washing the jacket will wash away the luck. She keeps the jacket in a closet all by itself. No other clothes are in the closet.<br/><br/>Anna had an important interview for a job. She was very nervous about it. She wanted to wear the jacket, but the jacket was not appropriate for the interview. She needed to wear nice clothes. She decided to wear the jacket under a plain gray sweater. Perfect plan, she thought.<br/><br/>When Anna entered the interview room, she started to sweat. She wondered why it was so hot. She realized that the heater was on. She sat down across from the interviewer. \"Anna, you\'re sweating. You should take your sweater off.\" Anna laughed nervously. \"I\'m fine,\" she said. By the end of the interview, there was a sweat stain on Anna\'s sweater. She left the interview feeling unsure. A week later Anna got a phone call from the boss. The boss offered her the job! The lucky jacket worked!'),
(3420, 72, 'Ten years ago, most adults had regular cell phones. Now people have smartphones. With smartphones, you can not only call people, but you can also go online, download new games, calculate a math problem, organize your schedule, and more. Smartphones are really helpful. Even kids have cell phones now.<br/><br/>People use their phones a lot these days, especially when they are waiting. People do not like to be bored, so they go on their phones. A lot of news reports are saying that people are looking at their phones way too much. People look at their phones when they are with others, and that is bad. Being addicted to something is never good.<br/><br/>When you go into a restaurant and look at other customers, most of them have phones in their hands. They would rather text, play a game, or go online than talk to the people around them. Some restaurants have even offered a free meal or a discount if customers are willing not to use their phones for an entire hour! People also use their phones before they sleep. This is bad for them, because it makes it harder for them to go to sleep. The light from the phone tricks our bodies into thinking we need to be awake.', 'amthanhchl_815795649.mp3', '', 'Nghe', 1, 0, 'Ten years ago, most adults had regular cell phones. Now people have smartphones. With smartphones, you can not only call people, but you can also go online, download new games, calculate a math problem, organize your schedule, and more. Smartphones are really helpful. Even kids have cell phones now.<br/><br/>People use their phones a lot these days, especially when they are waiting. People do not like to be bored, so they go on their phones. A lot of news reports are saying that people are looking at their phones way too much. People look at their phones when they are with others, and that is bad. Being addicted to something is never good.<br/><br/>When you go into a restaurant and look at other customers, most of them have phones in their hands. They would rather text, play a game, or go online than talk to the people around them. Some restaurants have even offered a free meal or a discount if customers are willing not to use their phones for an entire hour! People also use their phones before they sleep. This is bad for them, because it makes it harder for them to go to sleep. The light from the phone tricks our bodies into thinking we need to be awake.'),
(3421, 73, 'The terrorist attacks have scared a lot of people from studying abroad. Many students go to big cities to take pictures, shop, and explore. Terrorists attack these big cities though, because they know that there will be a lot of people. The truth is, we should not stop people from studying abroad. These terrorist attacks can happen anytime. We can\'t live life in fear. We must do the things we love.<br/><br/>People are also scared to travel in general, because of plane accidents. Terrorists often bring explosives on planes. Some people are also scared of dying on a plane. All the passengers in Malaysia Airlines Flight 370 are missing. We still don\'t know what happened to them. Not too long after, all the passengers in Malaysia Airlines Flight 17 died. It was a very tragic event.<br/><br/>It is scary that our lives can end so quickly and suddenly. We need to live life to the fullest. We need to love the people around us and be thankful for every day that we live. There are always news stories about people dying before they should. It\'s not the best thing to hear about, but it makes us more aware of our own lives.', 'amthanhchl_984209291.mp3', '', 'Nghe', 1, 0, 'The terrorist attacks have scared a lot of people from studying abroad. Many students go to big cities to take pictures, shop, and explore. Terrorists attack these big cities though, because they know that there will be a lot of people. The truth is, we should not stop people from studying abroad. These terrorist attacks can happen anytime. We can\'t live life in fear. We must do the things we love.<br/><br/>People are also scared to travel in general, because of plane accidents. Terrorists often bring explosives on planes. Some people are also scared of dying on a plane. All the passengers in Malaysia Airlines Flight 370 are missing. We still don\'t know what happened to them. Not too long after, all the passengers in Malaysia Airlines Flight 17 died. It was a very tragic event.<br/><br/>It is scary that our lives can end so quickly and suddenly. We need to live life to the fullest. We need to love the people around us and be thankful for every day that we live. There are always news stories about people dying before they should. It\'s not the best thing to hear about, but it makes us more aware of our own lives.'),
(3422, 74, 'Brenda has to make an important decision. She got accepted to an internship in France; she also got a job offer at a hospital. She can only do one though. She made a list of pros and cons. Pros are the good things while cons are the bad things.<br/><br/>The internship in France was good, because Brenda always wanted to go to France. Her plane tickets and living accommodation would be paid for. The bad thing about the internship was that it had nothing to do with her life goals. The internship required her to teach French children English. Brenda was okay with children, but she didn\'t love them.<br/><br/>One pro of the job offer at the hospital was that it was good for her end goal. Brenda\'s end goal was to be a doctor, and the job will teach her a lot about medical school. One con of the job offer was the location. The hospital is in a dangerous place where people have to be careful of being robbed and getting hurt. After a lot of thinking and looking at her list, Brenda decided to work at the hospital. She knew that working there would be good for her future.', 'amthanhchl_1798421178.mp3', '', 'Nghe', 1, 0, 'Brenda has to make an important decision. She got accepted to an internship in France; she also got a job offer at a hospital. She can only do one though. She made a list of pros and cons. Pros are the good things while cons are the bad things.<br/><br/>The internship in France was good, because Brenda always wanted to go to France. Her plane tickets and living accommodation would be paid for. The bad thing about the internship was that it had nothing to do with her life goals. The internship required her to teach French children English. Brenda was okay with children, but she didn\'t love them.<br/><br/>One pro of the job offer at the hospital was that it was good for her end goal. Brenda\'s end goal was to be a doctor, and the job will teach her a lot about medical school. One con of the job offer was the location. The hospital is in a dangerous place where people have to be careful of being robbed and getting hurt. After a lot of thinking and looking at her list, Brenda decided to work at the hospital. She knew that working there would be good for her future.'),
(3423, 232, 'A different hairstyle or color can change a person\'s entire look. It can make a person look better or worse. Jean was about to enter her first day of college. She wanted a new look. Her current hairstyle was nice, but it was boring. She had it since she was a 9th grader. Her hair right now was straight, long, and blonde. She went into the hair salon and asked the hairstylist.<br/><br/>\"What kind of look are you going for?\" the hairstylist asked. \"I want to look like a model,\" Jean said. \"Well, we can add layers to your hair. We can also make your hair more blonde,\" the hairstylist said. \"That sounds good!\" Jean said. Jean sat in the chair while the hairstylist cut her hair. Jean couldn\'t see herself in the mirror because she didn\'t have her glasses on. She just trusted the hairstylist. An hour later, the hairstylist said, \"Done!\" Jean put on her glasses and looked at herself. She looked totally different! She liked it, but felt strange. She could barely even recognize herself.<br/><br/>Jean asked her friends and family what they thought. Most of them liked it. They said it made her look edgier but very different. In fact, when she met up with her friends, they asked who she was. One of them even tried calling the police when Jean showed up in front of her house.<br/><br/>When Jean was shopping with her friends at the mall, a model scout came up to her and asked if she would consider modeling. Jean said she would think about it and took his business card. The new hairstyle was really working out for her.', 'amthanhchl_1722369728.mp3', '', 'Nghe', 1, 0, 'A different hairstyle or color can change a person\'s entire look. It can make a person look better or worse. Jean was about to enter her first day of college. She wanted a new look. Her current hairstyle was nice, but it was boring. She had it since she was a 9th grader. Her hair right now was straight, long, and blonde. She went into the hair salon and asked the hairstylist.<br/><br/>\"What kind of look are you going for?\" the hairstylist asked. \"I want to look like a model,\" Jean said. \"Well, we can add layers to your hair. We can also make your hair more blonde,\" the hairstylist said. \"That sounds good!\" Jean said. Jean sat in the chair while the hairstylist cut her hair. Jean couldn\'t see herself in the mirror because she didn\'t have her glasses on. She just trusted the hairstylist. An hour later, the hairstylist said, \"Done!\" Jean put on her glasses and looked at herself. She looked totally different! She liked it, but felt strange. She could barely even recognize herself.<br/><br/>Jean asked her friends and family what they thought. Most of them liked it. They said it made her look edgier but very different. In fact, when she met up with her friends, they asked who she was. One of them even tried calling the police when Jean showed up in front of her house.<br/><br/>When Jean was shopping with her friends at the mall, a model scout came up to her and asked if she would consider modeling. Jean said she would think about it and took his business card. The new hairstyle was really working out for her.'),
(3424, 233, 'Kelly\'s favorite holiday is Halloween. She loved pumpkin pie, pumpkin spice latte, dressing up, scary movies, and trick-or-treating. The sad thing, however, is that Kelly knows that she is too old for trick-or-treating. She is now 21 years old. She loved how she could get different kinds of candy for free.<br/><br/>This Halloween, Kelly was going to babysit her 10 year-old cousin Albert and his friends. Kelly dressed up as a pirate. Her cousin and his friends dressed as ghosts. Albert and his friends made Halloween themed cupcakes. The frosting was orange and the sprinkles on top were black. Afterwards, they carved pumpkins. Albert asked, \"What should we do now, Kelly?\" \"Why don\'t you go trick-or-treating?\" she suggested. \"I\'m too scared to talk to strangers,\" Albert said. \"Don\'t worry, I will go with you!\" Kelly said.<br/><br/>All of them went to the house to the right. They knocked on the door and said \"Trick-or-treat!\" The couple smiled and gave the kids a chocolate bar. Kelly wished they gave her one. They went to the next house and the family there gave them gummy worms. The next house they went to was interesting. The couple there gave them money! Kelly definitely wanted some money.<br/><br/>They went to a total of 10 houses and got more than 10 different types of candy. They all went back to Kelly\'s house. Kelly was sad looking at all their candy. Then, Albert and his friends gave Kelly a hug and said they loved hanging out with her.', 'amthanhchl_1898454461.mp3', '', 'Nghe', 1, 0, 'Kelly\'s favorite holiday is Halloween. She loved pumpkin pie, pumpkin spice latte, dressing up, scary movies, and trick-or-treating. The sad thing, however, is that Kelly knows that she is too old for trick-or-treating. She is now 21 years old. She loved how she could get different kinds of candy for free.<br/><br/>This Halloween, Kelly was going to babysit her 10 year-old cousin Albert and his friends. Kelly dressed up as a pirate. Her cousin and his friends dressed as ghosts. Albert and his friends made Halloween themed cupcakes. The frosting was orange and the sprinkles on top were black. Afterwards, they carved pumpkins. Albert asked, \"What should we do now, Kelly?\" \"Why don\'t you go trick-or-treating?\" she suggested. \"I\'m too scared to talk to strangers,\" Albert said. \"Don\'t worry, I will go with you!\" Kelly said.<br/><br/>All of them went to the house to the right. They knocked on the door and said \"Trick-or-treat!\" The couple smiled and gave the kids a chocolate bar. Kelly wished they gave her one. They went to the next house and the family there gave them gummy worms. The next house they went to was interesting. The couple there gave them money! Kelly definitely wanted some money.<br/><br/>They went to a total of 10 houses and got more than 10 different types of candy. They all went back to Kelly\'s house. Kelly was sad looking at all their candy. Then, Albert and his friends gave Kelly a hug and said they loved hanging out with her.'),
(3425, 234, 'Ophelia was a night shift worker at a hospital. This meant that she worked late at night. Ophelia\'s work schedule was 9 p.m. to 4 a.m. Ophelia would sleep during the day while most people were at work. For the first year of work, Ophelia had a hard time adjusting to the schedule. She had trouble sleeping during the afternoon. She was upset that she had to miss out on social events her friends hosted.<br/><br/>It\'s still hard for Ophelia to adjust, but she is better at it. When she comes back from work, she goes to the gym for a few hours. Then, she practices her knitting skills. Afterwards, she would make herself a healthy meal. Night shift workers often eat unhealthier than day shift workers. After lunch, she would watch her favorite TV show. After that, she would sleep.<br/><br/>The hospital informed the employees that they could send requests to change the time of their shift. Ophelia was excited about this and immediately sent in a request to change her shift. A couple of weeks later, the manager gave Ophelia a letter. The letter stated that her request was rejected. Ophelia was shocked. She went to her manager and asked him why. He said that many night shift workers who requested an earlier shift were elderly. Ophelia was only 25. The manager thought that the older employees needed an earlier shift more than Ophelia did. Ophelia was mad at first, but she thought about the older employees. Their bones were aching and they\'re tired. They do need it more than her.', 'amthanhchl_999410672.mp3', '', 'Nghe', 1, 0, 'Ophelia was a night shift worker at a hospital. This meant that she worked late at night. Ophelia\'s work schedule was 9 p.m. to 4 a.m. Ophelia would sleep during the day while most people were at work. For the first year of work, Ophelia had a hard time adjusting to the schedule. She had trouble sleeping during the afternoon. She was upset that she had to miss out on social events her friends hosted.<br/><br/>It\'s still hard for Ophelia to adjust, but she is better at it. When she comes back from work, she goes to the gym for a few hours. Then, she practices her knitting skills. Afterwards, she would make herself a healthy meal. Night shift workers often eat unhealthier than day shift workers. After lunch, she would watch her favorite TV show. After that, she would sleep.<br/><br/>The hospital informed the employees that they could send requests to change the time of their shift. Ophelia was excited about this and immediately sent in a request to change her shift. A couple of weeks later, the manager gave Ophelia a letter. The letter stated that her request was rejected. Ophelia was shocked. She went to her manager and asked him why. He said that many night shift workers who requested an earlier shift were elderly. Ophelia was only 25. The manager thought that the older employees needed an earlier shift more than Ophelia did. Ophelia was mad at first, but she thought about the older employees. Their bones were aching and they\'re tired. They do need it more than her.'),
(3426, 235, 'Janice is turning 21 today. Originally, she wanted to go to Las Vegas to celebrate. A lot of people go to Las Vegas for their 21st birthday because in the United States you can legally drink at 21. However, Janice decided not to go because she wanted to save money to buy a new car. Janice decided that she just wanted to go to a nice restaurant with her friends.<br/><br/>Janice\'s birthday was on a Tuesday, and she had class and work on Tuesdays. She always walked to class with her friend Austin. When she and Austin met up, she thought he would wish her a Happy Birthday, but he didn\'t. Austin has known her for years and he would always remember her birthday. Janice tried to drop hints. \"I wonder what today is,\" she said. \"Just a Tuesday, nothing special.\" Janice was upset. She ignored him during class.<br/><br/>After class, Janice went to work. She expected a few birthday cards or a cake, but nothing. She was surprised, because employees would always get something for their birthdays. This made Janice upset. She didn\'t even want to go out to eat for her birthday anymore. When Janice got home, she questioned if anyone even cared about her. Her friend Liza called her. \"Hey, can you open the door, we\'re here,\" Liza said. \"I don\'t want to go out anymore,\" Janice said. \"Why not? Can you just open the door, we\'re already here,\" Liza said. Janice opened the door. \"Surprise!\" her friends yelled. They had a puppy in their hands.', 'amthanhchl_1678759670.mp3', '', 'Nghe', 1, 0, 'Janice is turning 21 today. Originally, she wanted to go to Las Vegas to celebrate. A lot of people go to Las Vegas for their 21st birthday because in the United States you can legally drink at 21. However, Janice decided not to go because she wanted to save money to buy a new car. Janice decided that she just wanted to go to a nice restaurant with her friends.<br/><br/>Janice\'s birthday was on a Tuesday, and she had class and work on Tuesdays. She always walked to class with her friend Austin. When she and Austin met up, she thought he would wish her a Happy Birthday, but he didn\'t. Austin has known her for years and he would always remember her birthday. Janice tried to drop hints. \"I wonder what today is,\" she said. \"Just a Tuesday, nothing special.\" Janice was upset. She ignored him during class.<br/><br/>After class, Janice went to work. She expected a few birthday cards or a cake, but nothing. She was surprised, because employees would always get something for their birthdays. This made Janice upset. She didn\'t even want to go out to eat for her birthday anymore. When Janice got home, she questioned if anyone even cared about her. Her friend Liza called her. \"Hey, can you open the door, we\'re here,\" Liza said. \"I don\'t want to go out anymore,\" Janice said. \"Why not? Can you just open the door, we\'re already here,\" Liza said. Janice opened the door. \"Surprise!\" her friends yelled. They had a puppy in their hands.'),
(3427, 236, 'Kathy, Denise, Lauren, Andre, Harrison, and David are best friends. They all live in San Francisco. They live in different places and have different jobs, but at the end of their work day, they would meet up in the same cafe. They also had different personalities, but somehow they make it work. Kathy is a struggling writer. She is working on a fantasy novel and trying to get it published. Denise is a medical student at the University of California, San Francisco. Lauren is a TV screenwriter. Andre is also a medical student at the University of California, San Francisco. Harrison is an investment banker. David is a graphic designer.<br/><br/>How did they all meet? Kathy and Denise were friends in college and they moved to San Francisco together. They bumped into Lauren at a wine tasting event. The three of them became friends. Denise met Andre at medical school and Denise invited Andre to hang out with Kathy and Lauren at the museum. Lauren\'s cousin is Harrison. Harrison wanted a website for the company he worked at and hired David to design it. Lauren invited Harrison and David to come to the museum, too. When the six of them met up, they instantly became friends.<br/><br/>Sometimes their different personalities caused fights. Kathy was shy and traditional. Denise was outspoken. Lauren was kind but also naive. Andre was funny. Harrison was smart but also greedy. David was bossy but also caring. Even though they were different, though, they all cared about each other.', 'amthanhchl_488827598.mp3', '', 'Nghe', 1, 0, 'Kathy, Denise, Lauren, Andre, Harrison, and David are best friends. They all live in San Francisco. They live in different places and have different jobs, but at the end of their work day, they would meet up in the same cafe. They also had different personalities, but somehow they make it work. Kathy is a struggling writer. She is working on a fantasy novel and trying to get it published. Denise is a medical student at the University of California, San Francisco. Lauren is a TV screenwriter. Andre is also a medical student at the University of California, San Francisco. Harrison is an investment banker. David is a graphic designer.<br/><br/>How did they all meet? Kathy and Denise were friends in college and they moved to San Francisco together. They bumped into Lauren at a wine tasting event. The three of them became friends. Denise met Andre at medical school and Denise invited Andre to hang out with Kathy and Lauren at the museum. Lauren\'s cousin is Harrison. Harrison wanted a website for the company he worked at and hired David to design it. Lauren invited Harrison and David to come to the museum, too. When the six of them met up, they instantly became friends.<br/><br/>Sometimes their different personalities caused fights. Kathy was shy and traditional. Denise was outspoken. Lauren was kind but also naive. Andre was funny. Harrison was smart but also greedy. David was bossy but also caring. Even though they were different, though, they all cared about each other.'),
(3428, 237, 'Eddie and Cynthia both went to the same high school. They had liked each other since ninth grade. Eddie and Cynthia met in math class. Cynthia was really good at math. She always scored the highest out of everyone. Eddie was having trouble with math. He kept getting Fs. If he didn\'t bring his grade up to a C, he would have to repeat the class. The teacher asked Cynthia to help Eddie out for extra credit, and she said yes. Every day after school for two hours, Cynthia would help him. Eddie fell in love with her. He ended up with a B in the class. Eddie took Cynthia out to dinner to thank her.<br/><br/>At dinner, they both fell for each other. They started dating. Everything was good. They never had fights and even talked about getting married one day. When senior year came around, though, they had to apply to college. They didn\'t want to stop each other from going places, but they both wanted to stay together. Cynthia got into Harvard and wanted to major in math. Eddie did not get into Harvard. He got accepted to a school near Harvard but thought it would be better for him to stay closer to home. Cynthia ended up going to Harvard and Eddie ended up going to Florida State University. They tried to have a long distance relationship, but it was hard. They broke up after their first year of college. After they graduated, however, they both worked in Florida. They got back together.', 'amthanhchl_6186822.mp3', '', 'Nghe', 1, 0, 'Eddie and Cynthia both went to the same high school. They had liked each other since ninth grade. Eddie and Cynthia met in math class. Cynthia was really good at math. She always scored the highest out of everyone. Eddie was having trouble with math. He kept getting Fs. If he didn\'t bring his grade up to a C, he would have to repeat the class. The teacher asked Cynthia to help Eddie out for extra credit, and she said yes. Every day after school for two hours, Cynthia would help him. Eddie fell in love with her. He ended up with a B in the class. Eddie took Cynthia out to dinner to thank her.<br/><br/>At dinner, they both fell for each other. They started dating. Everything was good. They never had fights and even talked about getting married one day. When senior year came around, though, they had to apply to college. They didn\'t want to stop each other from going places, but they both wanted to stay together. Cynthia got into Harvard and wanted to major in math. Eddie did not get into Harvard. He got accepted to a school near Harvard but thought it would be better for him to stay closer to home. Cynthia ended up going to Harvard and Eddie ended up going to Florida State University. They tried to have a long distance relationship, but it was hard. They broke up after their first year of college. After they graduated, however, they both worked in Florida. They got back together.'),
