(3432, 315, 'Thịnh thích đọc sách. Bạn đã đến thư viện và đọc 15 cuốn sách vào thứ Hai. Sau đó, bạn đã đọc  thêm 9 cuốn sách vào thứ ba. Có bao nhiêu cuốn sách bạn đã đọc từ thư viện hai ngày đó?', '', '', 'toan', 1, 0, 'Thịnh thích đọc sách. Bạn đã đến thư viện và đọc 15 cuốn sách vào thứ Hai. Sau đó, bạn đã đọc  thêm 9 cuốn sách vào thứ ba. Có bao nhiêu cuốn sách bạn đã đọc từ thư viện hai ngày đó?'),
(3433, 238, 'Ruby always looked up to her cousin Wanda. Ruby was an only child in her family, so she saw Wanda as an older sister. Wanda was beautiful, smart, and talented. She had straight As, played the piano, and had so many friends. Wanda also had a great sense of style. It was classy yet cute. Ruby was still in high school but she knew she wanted to go to the same university as Wanda did.<br/><br/>Wanda knew that Ruby looked up to her and she appreciated that. For Christmas, Wanda got Ruby a sweater with her university\'s logo on it. Ruby was so happy when she got the sweater. She put it on immediately and wore it almost every day. One day in class, Ruby raised her hand to answer the teacher\'s question and the teacher accidentally called her Wanda. \"I\'m sorry, you just look a lot like her,\" the teacher said. \"Don\'t apologize, I\'m flattered\" Ruby said. Ruby was even in the same clubs in high school as Wanda was. Sometimes people made fun of Wanda for not having her own personality. However, the truth was Ruby was different from Wanda. Ruby was more goofy and girly.<br/><br/>When college admission decisions came out, Ruby was so anxious to check the website to see if she got in. She closed her eyes and slowly opened them. She found out she got accepted! She called Wanda to thank her for reading her application. The next day Wanda took Ruby to look at the school.', 'amthanhchl_940245390.mp3', '', 'Nghe', 1, 0, 'Ruby always looked up to her cousin Wanda. Ruby was an only child in her family, so she saw Wanda as an older sister. Wanda was beautiful, smart, and talented. She had straight As, played the piano, and had so many friends. Wanda also had a great sense of style. It was classy yet cute. Ruby was still in high school but she knew she wanted to go to the same university as Wanda did.<br/><br/>Wanda knew that Ruby looked up to her and she appreciated that. For Christmas, Wanda got Ruby a sweater with her university\'s logo on it. Ruby was so happy when she got the sweater. She put it on immediately and wore it almost every day. One day in class, Ruby raised her hand to answer the teacher\'s question and the teacher accidentally called her Wanda. \"I\'m sorry, you just look a lot like her,\" the teacher said. \"Don\'t apologize, I\'m flattered\" Ruby said. Ruby was even in the same clubs in high school as Wanda was. Sometimes people made fun of Wanda for not having her own personality. However, the truth was Ruby was different from Wanda. Ruby was more goofy and girly.<br/><br/>When college admission decisions came out, Ruby was so anxious to check the website to see if she got in. She closed her eyes and slowly opened them. She found out she got accepted! She called Wanda to thank her for reading her application. The next day Wanda took Ruby to look at the school.');
