(3435, 315, 'Một con gấu mẹ đã ăn 32 con cá. Con  của nó đã ăn 3 con cá. Trong tất cả, có bao nhiêu con cá đã được ăn?', '', '', 'toan', 1, 0, 'Một con gấu mẹ đã ăn 32 con cá. Con  của nó đã ăn 3 con cá. Trong tất cả, có bao nhiêu con cá đã được ăn?'),
