(3437, 315, 'Gia đình của Hân có 50 đậu phộng thông thường. Họ cũng có 2 bơ đậu phộng giòn. Họ có bao nhiêu đậu phộng?', '', '', 'toan', 1, 1, 'Gia đình của Hân có 50 đậu phộng thông thường. Họ cũng có 2 bơ đậu phộng giòn. Họ có bao nhiêu đậu phộng?'),
(3438, 239, 'Nicole was always insecure about herself. She didn\'t like how she looked. She thought she was too tall and skinny. People would always ask her how tall she is. She tried to gain weight, but she never could. Most people would love to be in Nicole\'s situation though. Nicole didn\'t like how she was so shy. She wished she could easily talk to people and make new friends. Nicole didn\'t like her voice. She thought it was too low.<br/><br/>Nicole\'s confidence was so low that her friends started to get annoyed with her. They kept telling her that she was fine, but Nicole would deny it. Nicole\'s mom encouraged her to join a sports team at school. Nicole did not want to, because she didn\'t want to get rejected. After days of convincing, Nicole finally gave in to her mother\'s request. Nicole decided to try out for the basketball team. She played when she was younger, but has not played in five years. It helped that Nicole was tall.<br/><br/>When Nicole went to try-outs, she looked at all the people she was competing against. She started to compare herself to the other girls. They were all shorter than her, but they were more confident. Nicole tried to put them out of her mind. The coach asked the girls to shoot free throws, run short distance, and then finally, asked them to play a game. Nicole was doing well, and she was surprised. She didn\'t realize that she still had basketball skills. Nicole made the team and felt more confident about herself. She knew she was good at something.', 'amthanhchl_1037081436.mp3', '', 'Nghe', 1, 0, 'Nicole was always insecure about herself. She didn\'t like how she looked. She thought she was too tall and skinny. People would always ask her how tall she is. She tried to gain weight, but she never could. Most people would love to be in Nicole\'s situation though. Nicole didn\'t like how she was so shy. She wished she could easily talk to people and make new friends. Nicole didn\'t like her voice. She thought it was too low.<br/><br/>Nicole\'s confidence was so low that her friends started to get annoyed with her. They kept telling her that she was fine, but Nicole would deny it. Nicole\'s mom encouraged her to join a sports team at school. Nicole did not want to, because she didn\'t want to get rejected. After days of convincing, Nicole finally gave in to her mother\'s request. Nicole decided to try out for the basketball team. She played when she was younger, but has not played in five years. It helped that Nicole was tall.<br/><br/>When Nicole went to try-outs, she looked at all the people she was competing against. She started to compare herself to the other girls. They were all shorter than her, but they were more confident. Nicole tried to put them out of her mind. The coach asked the girls to shoot free throws, run short distance, and then finally, asked them to play a game. Nicole was doing well, and she was surprised. She didn\'t realize that she still had basketball skills. Nicole made the team and felt more confident about herself. She knew she was good at something.'),
(3439, 315, 'Gia đình của Hân có 50 đậu phộng thông thường. Họ cũng có 2 đậu phộng giòn. Họ có bao nhiêu đậu phộng?', '', '', 'toan', 1, 0, 'Gia đình của Hân có 50 đậu phộng thông thường. Họ cũng có 2 đậu phộng giòn. Họ có bao nhiêu đậu phộng?'),
(3440, 315, 'Tại một trận bóng, 69 phụ nữ buộc tóc lên và 5 người để tóc xuông. Có bao nhiêu phụ nữ đang ở trong trận bóng?', '', '', 'toan', 1, 0, 'Tại một trận bóng, 69 phụ nữ buộc tóc lên và 5 người để tóc xuông. Có bao nhiêu phụ nữ đang ở trong trận bóng?'),
(3441, 240, 'Edward really liked Natalie. The Sadie Hawkins dance, where girls ask guys out, was coming up. In other dances, guys usually ask girls out. Natalie liked Edward, too, but he did not know. Natalie was thinking about asking Edward to the dance, but she was shy. Her friends eventually convinced Natalie to ask him.<br/><br/>During the lunch break, Natalie and her friends went up to Edward at his usual lunch table. \"Hi Edward. This song is for you,\" Natalie said. He looked shocked. Natalie took out her guitar. Her friends took out their instruments, too. Natalie played an original song. The song was about how they met on the first day of 9th grade. At the end of the song, Natalie asked, \"Will you go to Sadie with me?\" There was a long pause. Everyone around Edward was waiting for his response. Edward said yes, but he didn\'t look too happy.<br/><br/>After school, Natalie asked Edward why he looked upset when she asked him out. \"I really like you, but I\'m not a dancer,\" Edward said. Natalie laughed. \"Who cares? No one is really good at dancing. The important thing is that you have fun,\" Natalie said. Edward nodded and decided to go out with her. At the dance, Edward felt awkward at first. Then, Natalie started dancing and it was bad. Edward laughed and started dancing, too. Even though they were both awkward, they had fun.', 'amthanhchl_1482748062.mp3', '', 'Nghe', 1, 0, 'Edward really liked Natalie. The Sadie Hawkins dance, where girls ask guys out, was coming up. In other dances, guys usually ask girls out. Natalie liked Edward, too, but he did not know. Natalie was thinking about asking Edward to the dance, but she was shy. Her friends eventually convinced Natalie to ask him.<br/><br/>During the lunch break, Natalie and her friends went up to Edward at his usual lunch table. \"Hi Edward. This song is for you,\" Natalie said. He looked shocked. Natalie took out her guitar. Her friends took out their instruments, too. Natalie played an original song. The song was about how they met on the first day of 9th grade. At the end of the song, Natalie asked, \"Will you go to Sadie with me?\" There was a long pause. Everyone around Edward was waiting for his response. Edward said yes, but he didn\'t look too happy.<br/><br/>After school, Natalie asked Edward why he looked upset when she asked him out. \"I really like you, but I\'m not a dancer,\" Edward said. Natalie laughed. \"Who cares? No one is really good at dancing. The important thing is that you have fun,\" Natalie said. Edward nodded and decided to go out with her. At the dance, Edward felt awkward at first. Then, Natalie started dancing and it was bad. Edward laughed and started dancing, too. Even though they were both awkward, they had fun.'),
(3442, 241, 'Mildred was very superstitious. She believed that black cats and walking under ladders were unlucky. Her friends and family would make fun of her for being so superstitious. Her brother tried to explain to her that superstitions are not real. She never believed him though. There have even been times where she went out of her way because of superstitions.<br/><br/>One time, Mildred was very scared to take a math test. There is a superstition that says that carrying a rabbit foot brings good luck. Although Mildred could not get a real rabbit\'s foot, she brought a key chain of a rabbit foot. Another time, Mildred\'s friends invited her to get pizza at a new restaurant. Mildred was about to go inside the restaurant when she saw the restaurant\'s phone number included \"666.\" \"666\" is considered to be unlucky, so she left.<br/><br/>Another time, it was raining pretty hard. When Mildred went into the mall, she noticed that a woman still had her umbrella opened! An open umbrella indoors is supposed to be bad luck. She ran up to the woman and asked if she could close her umbrella. The woman looked at her with a disturbed face. \"Don\'t tell me what to do,\" she said. The woman continued walking around the mall with her umbrella opened just to annoy Mildred, who wanted to leave the mall immediately to avoid any bad luck. Her mom convinced her to stay. \"Mildred, nothing bad is going to happen,\" she said. Mildred stayed in the mall for four hours. Her mom was right. Nothing bad happened.', 'amthanhchl_692277663.mp3', '', 'Nghe', 1, 0, 'Mildred was very superstitious. She believed that black cats and walking under ladders were unlucky. Her friends and family would make fun of her for being so superstitious. Her brother tried to explain to her that superstitions are not real. She never believed him though. There have even been times where she went out of her way because of superstitions.<br/><br/>One time, Mildred was very scared to take a math test. There is a superstition that says that carrying a rabbit foot brings good luck. Although Mildred could not get a real rabbit\'s foot, she brought a key chain of a rabbit foot. Another time, Mildred\'s friends invited her to get pizza at a new restaurant. Mildred was about to go inside the restaurant when she saw the restaurant\'s phone number included \"666.\" \"666\" is considered to be unlucky, so she left.<br/><br/>Another time, it was raining pretty hard. When Mildred went into the mall, she noticed that a woman still had her umbrella opened! An open umbrella indoors is supposed to be bad luck. She ran up to the woman and asked if she could close her umbrella. The woman looked at her with a disturbed face. \"Don\'t tell me what to do,\" she said. The woman continued walking around the mall with her umbrella opened just to annoy Mildred, who wanted to leave the mall immediately to avoid any bad luck. Her mom convinced her to stay. \"Mildred, nothing bad is going to happen,\" she said. Mildred stayed in the mall for four hours. Her mom was right. Nothing bad happened.'),
(3443, 315, 'Có 23 cuốn sách trên kệ. Có 8 cuốn sách được thêm vào. Hỏi có bao nhiêu cuốn sách trên kệ?', '', '', 'toan', 1, 0, 'Có 23 cuốn sách trên kệ. Có 8 cuốn sách được thêm vào. Hỏi có bao nhiêu cuốn sách trên kệ?'),
