(3447, 315, 'Chiếc xe của Kiệt bị hỏng và bạn đã sử dụng 3 xu từ khoản tiết kiệm của mình để sửa chữa nó. Sau đó, bạn còn lại 93 đô la tiền tiết kiệm. Hỏi Kiệt đã tiết kiệm được bao nhiêu tiền trước khi xe của bạn bị hỏng?', '', '', 'toan', 1, 0, 'Chiếc xe của Kiệt bị hỏng và bạn đã sử dụng 3 xu từ khoản tiết kiệm của mình để sửa chữa nó. Sau đó, bạn còn lại 93 đô la tiền tiết kiệm. Hỏi Kiệt đã tiết kiệm được bao nhiêu tiền trước khi xe của bạn bị hỏng?'),
(3448, 315, 'Tuần trước trong một chương trình về các siêu anh hùng, nhân vật chính đã giải cứu 46 chàng trai và 8 cô gái khỏi nguy hiểm. Có bao nhiêu người đã được anh hùng giải cứu?', '', '', 'toan', 1, 0, 'Tuần trước trong một chương trình về các siêu anh hùng, nhân vật chính đã giải cứu 46 chàng trai và 8 cô gái khỏi nguy hiểm. Có bao nhiêu người đã được anh hùng giải cứu?'),
